INSERT INTO `catalogsearch_fulltext` (`fulltext_id`, `product_id`, `store_id`, `data_index`) VALUES
(2, 1, 1, '1500605|None|Product Name|© 2010 Example Corps Ltd. A Smith™ Product.|Black Matte • Packaged in an environmentally friendly gift box • Lifetime Guarantee • Fill with Zippo Premium Lighter Fluid • Made in the USA|16.5|1'),
(16, 2, 1, '28791-000003-Z|None|Classic|Give someone the gift of the sun, moon, and stars - on a Zippo windproof lighter. The combination of laser and auto engraving result in a crisply contrasted design on the matte finish - offered here for the first time. Comes packaged in an environmentally friendly gift box. For optimal performance, use with Zippo premium lighter fluid.|Give someone the gift of the sun, moon, and stars - on a Zippo windproof lighter. The combination of laser and auto engraving result in a crisply contrasted design on the matte finish - offered here for the first time.|28.95|1'),
(15, 3, 1, '28812-000003-Z|None|Harley-Davidson®|aa|Get ready to ride! This new Harley-Davidson® Zippo windproof lighter makes a great riding companion. Packaged in an environmentally friendly gift box. For optimal performance,|24.95|1'),
(14, 4, 1, '28815-000003-Z|None|Harley-Davidson®|ss|Put some color in your pocket. The Harley-Davidson® bar & shield logo is prominently engraved onto this unique stunning Spectrum™ windproof lighter, of which no two are exactly the same.|35.95|1'),
(13, 5, 1, '28796-000003-Z|None|Classic|a|This elegant lighter combines blocks of color imaging with blocks of auto engraving, resulting in a a many-textured brass and green design. Comes packaged in an environmentally friendly gift box.|32.95|1');
INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '<div class="container ftrInner clearfix">\r\n        	        <section class="ftrLeft">\r\n            	        <span>&copy; 2014 Zippo Manufacturing Company</span>\r\n                    </section>\r\n                    <nav id="ftrSocial" class="ftrSocial">\r\n                        <a href="{{store url=''privacy-policy''}}" class="ftrPrivacy"><span>Privacy <br> AND Legal</span></a>\r\n            	        <a href="http://www.zippoencore.com" target="_blank" class="ftrEncore" title="Zippo Encore"></a>\r\n            	        <a href="http://www.facebook.com/Zippo" target="_blank" class="ftrFB" title="Zippo on Facebook"></a>\r\n            	        <a href="http://www.youtube.com/zippo" class="ftrYouTube" target="_blank" title="Zippo YouTube Channel"></a>\r\n            	        <a href="http://www.instagram.com/originalzippo" class="ftrInstagram" target="_blank" title="Zippo Instagram Feed"></a>\r\n            	        <a href="http://twitter.com/#!/zippo" class="ftrTwitter" target="_blank" title="Zippo on Twitter"></a>\r\n                    </nav>\r\n                </div>', '2014-09-15 09:50:25', '2014-09-20 14:53:34', 1),
(2, 'Footer Links Company', 'footer_links_company', '\n<div class="links">\n    <div class="block-title">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href="{{store url=""}}about-magento-demo-store/">About Us</a></li>\n        <li><a href="{{store url=""}}contacts/">Contact Us</a></li>\n        <li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\n        <li><a href="{{store url=""}}privacy-policy-cookie-restriction-mode/">Privacy Policy</a></li>\n    </ul>\n</div>', '2014-09-15 09:50:26', '2014-09-15 09:50:26', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2014-09-15 09:50:26', '2014-09-15 09:50:26', 1),
(4, 'Home Content', 'home-content', '<section class="homeKickers home-box clearfix"> \r\n    <section class="">\r\n      <img class="homeKickerImg homeKickerImg2" alt="" src="{{skin url=''img/1_7_A.png''}}">\r\n      <!-- eo .sect1of4blackBtm --> \r\n    </section>\r\n    \r\n    <!-- eo .sect2of4black -->\r\n    <section class="">\r\n      <img class="homeKickerImg homeKickerImg2" alt="" src="{{skin url=''img/1_7_B.png''}}">\r\n      <!-- eo .sect1of4blackBtm --> \r\n    </section>\r\n    \r\n    <!-- eo .sect1of4black -->\r\n    <section class="">\r\n       <img class="homeKickerImg homeKickerImg2" alt="" src="{{skin url=''img/1_7_C.png''}}">\r\n      <!-- eo .sect1of4blackBtm --> \r\n    </section>\r\n    <!-- eo .sect1of4black --> \r\n  </section>\r\n', '2014-09-16 19:26:41', '2014-09-22 23:18:30', 1),
(5, 'Top Links', 'top-links', '<div>\r\n<a class="home" href="{{store url=''home''}}">Home</a> \r\n<a class="customer" href="{{store url=''customer''}}">Customer Care</a> \r\n<a class="about" href="{{store url=''about-us''}}">About Us</a> \r\n<a class="account" href="{{store url=''customer/account/login/''}}">My Account</a> \r\n<a class="gift" href="{{store url=''aboutus''}}">Gift Card</a> \r\n<a class="search" href="{{store url=''catalogsearch/advanced/''}}">Search</a> \r\n<a class="email" href="{{store url=''mailinglist''}}">Email Signup</a> \r\n<a class="stores" href="{{store url=''stores''}}">Stores</a></div>', '2014-09-16 19:46:20', '2014-09-23 00:31:31', 1),
(6, 'About Left Links', 'about-left-nav', '<p><a href="{{store url=''current-news''}}">Current News</a> <a href="{{store url=''then-and-now''}}">Then and Now</a> <a href="{{store url=''date-codes''}}">Date Codes</a></p>', '2014-09-19 20:24:29', '2014-09-20 12:51:11', 1),
(7, 'Customer Care Left Links', 'customer-care', '<p>\r\n\r\n<a class="contact-us" href="{{store url=''contact-us''}}">Contact Us</a> \r\n<a class="store-information" href="{{store url=''store-information''}}">Store Information</a> \r\n<a class="product-intructions" href="{{store url=''product-intructions''}}">Product Instruction</a> \r\n<a class="safety-data" href="{{store url=''safety-data''}}">Safty Data</a> \r\n<a class="repairs" href="{{store url=''repairs''}}">Repairs</a>\r\n\r\n</p>', '2014-09-19 21:04:43', '2014-09-23 00:05:10', 1),
(8, 'privacy', 'privacy-links', '<p><a class="active" href="{{store url=''terms-and-conditions''}}">Terms &amp; Conditions</a> <a class="active" href="{{store url=''privacy-policy''}}">Privacy Policy</a> <a class="active" href="{{store url=''brand-protection''}}">Brand Protection</a> <a class="active" href="{{store url=''acution-website-sales''}}">Auction Website Sales</a> <a class="active" href="{{store url=''product-patents''}}">Product Patents</a></p>', '2014-09-20 00:10:54', '2014-09-20 15:38:55', 1);
