(5, 'Enable Cookies', 'one_column', NULL, NULL, 'enable-cookies', NULL, '<div class="std">\n    <ul class="messages">\n        <li class="notice-msg">\n            <ul>\n                <li>Please enable cookies in your web browser to continue.</li>\n            </ul>\n        </li>\n    </ul>\n    <div class="page-title">\n        <h1><a name="top"></a>What are Cookies?</h1>\n    </div>\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website.\n    On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically\n    whenever you visit our site so that we can personalize your experience and provide you with better service.\n    We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes.\n     If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase\n     or take advantage of certain features of our website, such as storing items in your Shopping Cart or\n     receiving personalized recommendations. As a result, we strongly encourage you to configure your web\n     browser to accept cookies from our website.</p>\n    <h2 class="subtitle">Enabling Cookies</h2>\n    <ul class="disc">\n        <li><a href="#ie7">Internet Explorer 7.x</a></li>\n        <li><a href="#ie6">Internet Explorer 6.x</a></li>\n        <li><a href="#firefox">Mozilla/Firefox</a></li>\n        <li><a href="#opera">Opera 7.x</a></li>\n    </ul>\n    <h3><a name="ie7"></a>Internet Explorer 7.x</h3>\n    <ol>\n        <li>\n            <p>Start Internet Explorer</p>\n        </li>\n        <li>\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-1.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Privacy</strong> tab</p>\n            <p><img src="{{skin url="images/cookies/ie7-2.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Advanced</strong> button</p>\n            <p><img src="{{skin url="images/cookies/ie7-3.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>,\n            put another check mark in the <strong>Always accept session cookies </strong>box</p>\n            <p><img src="{{skin url="images/cookies/ie7-4.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-5.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-6.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Restart Internet Explore</p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="ie6"></a>Internet Explorer 6.x</h3>\n    <ol>\n        <li>\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\n            <p><img src="{{skin url="images/cookies/ie6-1.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> tab</p>\n        </li>\n        <li>\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>)\n            under <strong>Settings</strong>. Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie6-2.gif"}}" alt="" /></p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="firefox"></a>Mozilla/Firefox</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\n            <p><img src="{{skin url="images/cookies/firefox.png"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Expand the <strong>Cookies</strong> section</p>\n        </li>\n        <li>\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="opera"></a>Opera 7.x</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\n            <p><img src="{{skin url="images/cookies/opera.png"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong>\n            should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong></p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n</div>\n', '2014-09-15 09:50:25', '2014-09-15 09:50:25', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(7, 'About Us', 'one_column', NULL, NULL, 'about-us', NULL, '<section class="wholePage clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">ABOUT US </h2>\r\n                        <nav class="leftInnerNav txtBebas">\r\n                        {{block type="cms/block" block_id="about-left-nav"}}\r\n                        </nav>\r\n                        <section id="aboutContent" class="wholeContent">\r\n                            <div class="inner clearfix">\r\n                                <h3 class="hdrWholeCont txtRed txtBebas">Dates In History</h3>\r\n                                <p class="txtBold">Zippo has celebrated nearly eight decades of milestones - some big, others not so much. Scroll through and recollect some of our red-letter days.\r\n</p>\r\n                                <ul class="timelineHdr txtBebas"><li>6.05.1895</li><li>6.01.1933</li><li>3.03.1936</li><li>3.27.1938</li><li>12.01.1938</li><li>2.14.1940</li><li>5.08.1943</li><li>11.24.1943</li></ul><ul id="timeItems" class="timeItems"><li><img width="85" height="115" alt="6.05.1895" src="http://images.zippo.com/images/c9/1_214.png">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">6.05.1895</h4>\r\n                                <h5 class="txtRed txtBebas">Mr. Blaisdell''s Birthday</h5>\r\n                                <p class="txtBold">Mr. George Blaisdell was born in Bradford, Pennsylvania on June 5, 1895.</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="6.01.1933" src="http://images.zippo.com/images/c9/1_213.png">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">6.01.1933</h4>\r\n                                <h5 class="txtRed txtBebas">Rickerson &amp; Pryde</h5>\r\n                                <p class="txtBold">Zippo occupied the Rickerson &amp; Pryde factory.  This became Zippo''s first building. \r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="3.03.1936" src="http://images.zippo.com/images/c9/1_183.gif">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">3.03.1936</h4>\r\n                                <h5 class="txtRed txtBebas">First Patent</h5>\r\n                                <p class="txtBold">Zippo''s first patent number 203269 for the Zippo windproof lighter was granted.\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="3.27.1938" src="http://images.zippo.com/images/c9/1_191.png">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">3.27.1938</h4>\r\n                                <h5 class="txtRed txtBebas">Barbour Street</h5>\r\n                                <p class="txtBold">The first building that Zippo purchased was on Barbour Street.</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="12.01.1938" src="http://images.zippo.com/images/c9/1_248.png">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">12.01.1938</h4>\r\n                                <h5 class="txtRed txtBebas">First National Ad</h5>\r\n                                <p class="txtBold">The first national ad for Zippo appeared in Esquire magazine.\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="2.14.1940" src="http://images.zippo.com/images/c9/1_176.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">2.14.1940</h4>\r\n                                <h5 class="txtRed txtBebas">Pantograph Engraving</h5>\r\n                                <p class="txtBold">Pantograph engraved initials replaced metallic initials on the lighters.\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="5.08.1943" src="http://images.zippo.com/images/c9/1_203.png">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">5.08.1943</h4>\r\n                                <h5 class="txtRed txtBebas">Zippo in the Military</h5>\r\n                                <p class="txtBold">Zippo''s newspaper ad announced that all production is dedicated to the armed forces overseas. \r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="11.24.1943" src="http://images.zippo.com/images/c9/1_247.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">11.24.1943</h4>\r\n                                <h5 class="txtRed txtBebas">Gen. Eisenhower</h5>\r\n                                <p class="txtBold">A letter to George Blaisdell from General Dwight D. Eisenhower read, "It''s the only lighter I''ve got that will light at all times."\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li></ul><ul class="timelineHdr txtBebas"><li>5.30.1944</li><li>6.06.1944</li><li>9.25.1944</li><li>6.16.1947</li><li>8.01.1949</li><li>9.04.1949</li><li>1.07.1950</li><li>5.01.1950</li></ul><ul id="timeItems" class="timeItems"><li><img width="85" height="115" alt="5.30.1944" src="http://images.zippo.com/images/c9/1_212.png">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">5.30.1944</h4>\r\n                                <h5 class="txtRed txtBebas">Ernie Pyle</h5>\r\n                                <p class="txtBold">War correspondent Ernie Pyle devoted a national newspaper column to Zippo lighters and George Blaisdell. \r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="6.06.1944" src="http://images.zippo.com/images/c9/1_215.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">6.06.1944</h4>\r\n                                <h5 class="txtRed txtBebas">D-Day</h5>\r\n                                <p class="txtBold">Walter Nadler inscribed a lighter while making the D-Day crossing. The lighter is currently displayed in Zippo museum.\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="9.25.1944" src="http://images.zippo.com/images/c9/1_242.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">9.25.1944</h4>\r\n                                <h5 class="txtRed txtBebas">Gen. MacArthur</h5>\r\n                                <p class="txtBold">A letter to Mr. Blaisdell from General Douglas MacArthur read, "It is a real work of art which I shall use constantly."\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="6.16.1947" src="http://images.zippo.com/images/c9/1_220.gif">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">6.16.1947</h4>\r\n                                <h5 class="txtRed txtBebas">Original Zippo Car</h5>\r\n                                <p class="txtBold">The original Zippo car was purchased by George Blaisdell.\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="8.01.1949" src="http://images.zippo.com/images/c9/1_229.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">8.01.1949</h4>\r\n                                <h5 class="txtRed txtBebas">Zippo Canada</h5>\r\n                                <p class="txtBold">Zippo opened a plant in Canada.</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="9.04.1949" src="http://images.zippo.com/images/c9/1_237.gif">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">9.04.1949</h4>\r\n                                <h5 class="txtRed txtBebas">Town &amp; Country</h5>\r\n                                <p class="txtBold">The Town and Country imprint process was introduced.\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="1.07.1950" src="http://images.zippo.com/images/c9/1_149.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">1.07.1950</h4>\r\n                                <h5 class="txtRed txtBebas">Blaisdell Foundation Established</h5>\r\n                                <p class="txtBold">Zippo founder, George G. Blaisdell established the Philo and Sara Blaisdell Foundation in honor of his parents.  </p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="5.01.1950" src="http://images.zippo.com/images/c9/1_202.JPG">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">5.01.1950</h4>\r\n                                <h5 class="txtRed txtBebas">Lady Bradford</h5>\r\n                                <p class="txtBold">Zippo''s Lady Bradford table lighter introduced.\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li></ul><ul class="timelineHdr txtBebas"><li>8.01.1950</li><li>3.06.1951</li><li>12.24.1952</li><li>2.02.1954</li><li>8.01.1955</li><li>9.15.1955</li><li>6.08.1956</li><li>3.07.1957</li></ul><ul id="timeItems" class="timeItems"><li><img width="85" height="115" alt="8.01.1950" src="http://images.zippo.com/images/c9/1_230.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">8.01.1950</h4>\r\n                                <h5 class="txtRed txtBebas">2nd Patent Number</h5>\r\n                                <p class="txtBold">Second lighter patent number 2517191 was introduced.\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="3.06.1951" src="http://images.zippo.com/images/c9/1_184.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">3.06.1951</h4>\r\n                                <h5 class="txtRed txtBebas">Zip Slip and Zireen</h5>\r\n                                <p class="txtBold">The introduction of two unusual Zippo products: Zip Slip zipper lubricant and Zireen skin ointment.\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="12.24.1952" src="http://images.zippo.com/images/c9/1_250.png">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">12.24.1952</h4>\r\n                                <h5 class="txtRed txtBebas">New Building</h5>\r\n                                <p class="txtBold">George Blaisdell announces plans to construct that 3 story office building on Barbour Street.</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="2.02.1954" src="http://images.zippo.com/images/c9/1_172.gif">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">2.02.1954</h4>\r\n                                <h5 class="txtRed txtBebas">I Love Lucy</h5>\r\n                                <p class="txtBold">Zippo introduced the table lighter that was featured on 82nd Episode of the sitcom "I Love Lucy".\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="8.01.1955" src="http://images.zippo.com/images/c9/1_231.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">8.01.1955</h4>\r\n                                <h5 class="txtRed txtBebas">New Offices</h5>\r\n                                <p class="txtBold">The new office building at 33 Barbour Street became the new corporate office.\r\n</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="9.15.1955" src="http://images.zippo.com/images/c9/1_240.gif">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopI