utPopHdr txtBebas">1.01.2012</h4>\r\n                                <h5 class="txtRed txtBebas">80TH ANNIVERSARY</h5>\r\n                                <p class="txtBold">Zppo celebrates 80 years of success.</p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="6.04.2012" src="http://images.zippo.com/images/c9/1_300.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">6.04.2012</h4>\r\n                                <h5 class="txtRed txtBebas">Zippo/Case Museum Store Gets NEW Look</h5>\r\n                                <p class="txtBold">Nearly 15 years after Zippo/Case Museum opened its doors, the store went through an extreme modernization and face lift.</p>\r\n                            </div>\r\n                        </div>\r\n                    </li></ul><ul class="timelineHdr txtBebas"><li>6.5.2012</li><li>10.01.2012</li><li>07.18.2013</li><li>10.03.2013</li><li>7.23.2014</li><li>7.30.2014</li></ul><ul id="timeItems" class="timeItems"><li><img width="85" height="115" alt="6.5.2012" src="http://images.zippo.com/images/c9/1_297.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">6.5.2012</h4>\r\n                                <h5 class="txtRed txtBebas">500 Millionth Lighter</h5>\r\n                                <p class="txtBold">500 Millionth Lighter rolls off the production line in Bradford PA. </p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="10.01.2012" src="http://images.zippo.com/images/c9/1_327.jpg">\r\n    