ight="115" alt="7.23.2014" src="http://images.zippo.com/images/c9/1_349.jpg">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">7.23.2014</h4>\r\n                                <h5 class="txtRed txtBebas">W.R. Case &amp; Sons Cutlery Company celebrates 125 years </h5>\r\n                                <p class="txtBold">Known for hand crafted, premium quality knives in Bradford, PA.  </p>\r\n                            </div>\r\n                        </div>\r\n                    </li><li><img width="85" height="115" alt="7.30.2014" src="http://images.zippo.com/images/c9/1_350.png">\r\n                        <div class="productListingPopup clearfix aboutPop" style="left: -9999px;">\r\n                            <div class="aboutPopInner">\r\n                                <h4 class="aboutPopHdr txtBebas">7.30.2014</h4>\r\n                                <h5 class="txtRed txtBebas"></h5>\r\n                                <p class="txtBold">Zippo launched its All-Terrain Grill&trade; as part of the Zippo Outdoor products.  The Grill was built with a cast aluminum body, burners, legs, axles and wheels built to handle any rough terrain. </p>\r\n                            </div>\r\n                        </div>\r\n                    </li>\r\n                            </ul></div>\r\n                            <!-- eo .inner -->\r\n                        </section><!-- eo .wholeContent -->\r\n                    </div>\r\n                    <!-- eo .wholeInner -->\r\n                </div>\r\n                <!-- eo .wholeMain -->\r\n            </section>', '2014-09-16 20:40:09', '2014-09-20 00:41:00', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
