eft; white-space: nowrap; display: none;" draggable="false" title="Show imagery with street names"><span role="checkbox" style="box-sizing: border-box; position: relative; line-height: 0; font-size: 0px; margin: 0px 5px 0px 0px; display: inline-block; background-color: rgb(255, 255, 255); border: 1px solid rgb(198, 198, 198); border-radius: 1px; width: 13px; height: 13px; vertical-align: middle;"><div style="position: absolute; left: 1px; top: -2px; width: 13px; height: 11px; overflow: hidden;"><img style="position: absolute; left: -52px; top: -44px; -moz-user-select: none; border: 0px none; padding: 0px; margin: 0px; width: 68px; height: 67px;" src="http://maps.gstatic.com/mapfiles/mv/imgs8.png" draggable="false"></div></span><label style="vertical-align: middle; cursor: pointer;">Labels</label></div></div></div></div></div>\r\n                        <div class="storeListInfo">\r\n                            <h4 class="txtBebas txtBlack">The Great Alaska Tobacco Co.</h4>\r\n                            <span class="addrStreet">2810 Minnesota Dr.<br></span><br>\r\n                            <span class="addrCity">Anchorage</span>, <span class="addrState">AK</span> <span class="addrZip">99503</span><br>\r\n                            Phone: 907-297-5559<br>\r\n                            <br>\r\n                            <a target="_blank" id="lnkDir9" class="lnkDirections txtRed" href="http://maps.google.com/maps?q=2810 Minnesota Dr. +Anchorage+AK+99503">Get directions</a> </div>\r\n                        <div class="storeProds">\r\n                            <h4 class="txtBebas txtBlack">products at this store</h4>\r\n                            <span class="storeProdItem txtBebas">lighters</span> <span class="storeProdItem txtBebas">supplies</span>  </div>\r\n                        <div class="storeDistance">\r\n                         <!--   <h4 class="txtBebas txtBlack">distance</h4>\r\n                            <span class="txtRed">0 miles</span>--> </