INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(9, 'Customer Care ', 'one_column', NULL, NULL, 'customer', NULL, '<section class="wholePage clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">Customer Care </h2>\r\n                        <nav class="leftInnerNav txtBebas">\r\n\r\n{{block type="cms/block" block_id="customer-care"}}\r\n</nav>\r\n                        <section id="contactContent" class="wholeContent">\r\n                            <form id="frmMain" action="contact_us.aspx" method="post" name="frmMain">\r\n<div>\r\n<input type="hidden" value="" id="__EVENTTARGET" name="__EVENTTARGET">\r\n<input type="hidden" value="" id="__EVENTARGUMENT" name="__EVENTARGUMENT">\r\n<input type="hidden" value="/wEPDwUJLTkzODIxODIwZGSyKgIhHYNlNqhuk8qL0BwkragKGg==" id="__VIEWSTATE" name="__VIEWSTATE">\r\n</div>\r\n\r\n<script type="text/javascript">\r\n//&lt;![CDATA[\r\nvar theForm = document.forms[''frmMain''];\r\nif (!theForm) {\r\n    theForm = document.frmMain;\r\n}\r\nfunction __doPostBack(eventTarget, eventArgument) {\r\n    if (!theForm.onsubmit || (theForm.onsubmit() != false)) {\r\n        theForm.__EVENTTARGET.value = eventTarget;\r\n        theForm.__EVENTARGUMENT.value = eventArgument;\r\n        theForm.submit();\r\n    }\r\n}\r\n//]]&gt;\r\n</script>\r\n\r\n\r\n<div>\r\n\r\n	<input type="hidden" value="/wEWEgLrq+E4Auycia0BArzor3kCm86mJAKbzu7HAgL7nPiqBwL7nLCpBwLQ38TuBALHh9bpAgL8v/mQBwLLh8mZCQK+ie/YBgKNmpfsBAKX3bGnBgKE8/26DAK/1s7/DwLPwsKfAQLQ1d+LCgcpfOkjabaC7H/wNfIibw+ypgtc" id="__EVENTVALIDATION" name="__EVENTVALIDATION">\r\n</div>\r\n                            <div class="inner clearfix">\r\n                                <header class="hdrWhole txtRed txtBebas">Get In Touch With Zippo</header>\r\n                                <p class="txtBold">Before sending an email or picking up the phone, check the list of \r\n                                    <a class="txtRed" href="article.aspx?id=1796">FAQ''s</a> for one that may answer your question. We have collected a list of the top FAQ''s, to help you get the answers you need faster. </p>\r\n                                <ul id="contactOptions" class="contactOpts txtBebas">\r\n                                    <li class="first"><a class="contactOpt" id="lnkOnlineOrders" href="#">Online orders</a> </li>\r\n                                    <li><a class="contactOpt" id="lnkSales" href="#">New Retailer Inquiries</a> </li>\r\n                                    <li><a class="contactOpt" id="lnkMedia" href="#">Media and PR</a> </li>\r\n                                    <li><a class="contactOpt" id="lnkGeneral" href="#">General Inquiries</a> </li>\r\n                                </ul>\r\n                                <div id="contactForms" class="contactForms">\r\n                                    <div id="dvOnlineOrders" class="oneform">\r\n                                        <h3 id="contactHeading" class="txtRed txtBebas">ONLINE ORDERS</h3>\r\n                                        <p class="txtBold">Providing exceptional service is our priority; feedback is always welcomed. If your inquiry is time-sensitive, please call us Monday-Friday 8:00 am to 4:30 pm EST at 888.442.1932.</p>\r\n                                        <p class="txtBold">Fields marked with <strong class="txtRed">*</strong> are required.</p>\r\n                                        <ul class="contactFields">\r\n                                            <li id="liOrderNum">\r\n                                                <label class="txtBlack txtBebas" for="txtOrderNumber">Order Number <strong class="txtRed">*</strong></label><span class="frmError" id="lblOrderNumberErr"></span>\r\n                                                <input type="text" tabindex="1" class="txtDef" id="txtOrderNumber" name="txtOrderNumber">\r\n                                            </li>\r\n                       