(12, 'Current News', 'one_column', NULL, NULL, 'current-news', NULL, '<section class="wholePage clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">ABOUT US </h2>\r\n                        <nav class="leftInnerNav txtBebas">{{block type="cms/block" block_id="about-left-nav"}}</nav>\r\n                        <section id="aboutContent" class="wholeContent">\r\n                            <div class="inner clearfix">\r\n                                <h3 class="hdrWholeCont txtRed txtBebas">\r\n                                    Current News</h3>\r\n                                <div style="padding-left: 20px; padding-right: 30px;">\r\n<p style="font-size: 18px; color: #000000;"><b>Zippo Presents the Campfire Outdoor Adventure and Music Festival </b></p>\r\n\r\n<p><img height="250px" align="right" style="padding:8px;" src="/images/editorials/1_1603_AV_campfirefestival.png">\r\n\r\n</p><p>August 18, 2014 &ndash; The inaugural <a style="color: #ff0000;" target="_blank" ;="" href="http://campfirefestival.com">Campfire Outdoor Adventure and Music Festival presented by Zippo</a>, held Labor Day weekend in Lakewood, Pennsylvania, is an event you <a style="color: #ff0000;" target="_blank" ;="" href="http://bit.ly/1wX1hbs">won''t want to pass up.</a> </p> \r\n\r\n<p>In addition to a <a style="color: #ff0000;" target="_blank" ;="" href="http://campfirefestival.com/schedule">full weekend of music</a>, a range of other activities are also scheduled. These include rock climbing, lake and obstacle courses, team sports, a Golf mixer, late night Silent Disco, and daily VIP Happy Hour pool parties with live DJs.</p>\r\n\r\n<p><a style="color: #ff0000;" target="_blank" ;="" href="http://www.campfirefestival.com/info/#getting-here">Luxury transportation</a> is available to and from the weekend event for those traveling from New York City, Philadelphia, and Scranton/Wilkes-Barre. Travel tickets range from $35 to $60 and are available up until August 22nd. </p>\r\n\r\n<p>Pennsylvania residents have the exclusive ability to purchase <a style="color: #ff0000;" target="_blank" ;="" href="http://www.campfirefestival.com/accommodations/#day-passes">one-day passes</a> for just $55. If you''re interested, email Campfire Festival and they will provide you with a super secret link to purchase your pass.</p>\r\n</div>\r\n\r\n\r\n<div style="padding-left: 20px; padding-right: 30px;">\r\n<p style="font-size: 18px; color: #000000;"><b>W.R. Case &amp; Sons Cutlery Company Celebrates 125 Years</b></p>\r\n\r\n<p><img height="250px" align="left" style="padding:8px;" src="/images/editorials/1_1603_AV_Case125.jpg"></p>\r\n\r\n\r\n<p>June 20, 2014 &ndash; This year, W.R. Case &amp; Sons Cutlery Company, an American manufacturer of premium quality knives, proudly celebrates 125 years of award-winning hand-craftsmanship, small-town heritage and time-honored tradition.  The company’s rich history began in 1889 when four Case Brothers began fashioning knives and selling them along a wagon trail in Upstate New York.  </p>\r\n\r\n<p>“Zippo acquired W.R. Case &amp; Sons Cutlery Company in 1993 and we are very proud of what we have been able to achieve in the last 20 years by bringing these two iconic brands together,” said Greg Booth, CEO, Zippo/W.R. Case &amp; Sons Cutlery Company. </p>\r\n\r\n<p>To further this commitment, Case Cutlery’s parent company, Zippo Manufacturing Company, is investing nearly $10 million dollars toward renovating their Bradford, Pennsylvania factory. The renovations, which are currently underway and expected to finish by the end of 2015, include a complete remodeling of the Case factory that was originally constructed in 1975, including new equipment and floor configurations that will allow better efficiency, productivity and quality without affecting the hand-craftsmanship that has always gone into every Case knife. </p>\r\n\r\n<p>“With Case, our current focus is on improving efficiency, which we hope to achieve with this new investment, and drive future innovation and new product development,” Booth added.</p>\r\n\r\n<p>Case’s products range from the classic patterns like the Case Trapper, Stockman, Peanut and Tiny Toothpick that are meant for everyday use to collectibles, mint sets and commemorative items that adorn living room walls and "man caves" all across America.</p>\r\n</div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div style="padding-left: 20px; padding-right: 30px;">\r\n<p style="font-size: 18px; color: #000000;"><b>Zippo Expert to Speak at New Las Vegas Zippo Store</b></p>\r\n\r\n<p><img height="250px" align="right" style="padding:8px;" src="/images/editorials/1_1603_AV_zippostore.jpg"></p>\r\n\r\n\r\n<p><br>May 21, 2014 &ndash; A special event is planned by the Luxor Hotel and Casino, one of the Las Vegas Strip’s most iconic destinations, on June 5 and 6 as part of the opening celebration for the Las Vegas Zippo store.</p>\r\n\r\n<p>The Luxor will host a “Meet the Zippo Expert” with Zippo Historian and Zippo/Case Museum Curator Linda Meabon Thursday from 1 to 3 p.m. and Friday, from 10 a.m. to 12 pm.</p>\r\n\r\n<p>The Zippo store will offer a free gift with purchase, while supplies last, during the “Meet the Zippo Expert” event hours. Attendees can also enter for a chance to win a Zippo lighter.</p>\r\n\r\n<p>The Zippo store is located in the Galleria at the Luxor next to the moving walkway that leads to Excalibur Hotel and Casino.</p>\r\n\r\n<p>“This event is a great opportunity to share Zippo’s fascinating history with visitors to the exciting new Zippo store,” Meabon said. “I am so pleased to be able to share another Zippo first &ndash; the opening of this first official Zippo store &ndash; with our fans.”</p>\r\n\r\n<p>A second Zippo store will open later this summer at the MGM Grand Hotel and Casino.</p>\r\n\r\n<p>Both stores will feature the bulk of Zippo’s expanding product line, including windproof lighters and lighter products, apparel, bags, fragrances, and small leather goods.</p>\r\n</div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</div>\r\n\r\n<div style="padding-left: 20px; padding-right: 30px;">\r\n<p style="font-size: 18px; color: #000000;"><b>2014 Rock Music Festivals Set</b></p>\r\n\r\n<p><img height="225px" align="right" style="padding:8px;" src="/images/editorials/1_1603_AV_zippoencore.jpg">\r\n\r\n</p><p>April 14, 2014 - Zippo Encore has announced the 2014 lineup of top music festivals that includes new relationships with the <a style="color: #ff0000;" target="_blank" ;="" href="http://www.CounterPointFestival.com">CounterPoint Music and Arts Festival</a> near Atlanta, GA; <a style="color: #ff0000;" target="_blank" ;="" href="http://www.CarolinaRebellion.com"> Monster Energy’s Carolina Rebellion</a> near Charlotte, NC; <a style="color: #ff0000;" target="_blank" ;="" href="http://www.RockOnTheRange.com">Rock On The Range</a> in Columbus, OH; <a style="color: #ff0000;" target="_blank" ;="" href="http://www.rocklahoma.com">Rocklahoma</a> in Pryor, OK; and continues its partnership with  <a style="color: #ff0000;" target="_blank" ;="" href="http://www.rockstarmayhemfest.com">Rockstar Energy Drink Mayhem Festival</a>, which visits 24 cities across the U.S. this summer.</p>\r\n\r\n<p>Zippo Encore’s retail shop will feature exclusive custom lighters designed by the bands and a limited edition festival lighter at each festival.  Visitors to the Zippo Encore shop at each festival can participate in an onsite lighter design contest by creating a hand-drawn design at the booth. The best design--as chosen by festival-goers who visit the booth--will win a Zippo Encore Schecter Guitar. Visitors can also participate in the “Spin It To Win It” game to win prizes.</p>\r\n\r\n<p>For details, go to <a style="color: #ff0000;" target="_blank" ;="" href="http://www.Facebook.com/ZippoEncore">Facebook.com/ZippoEncore</a>. Remember to check the Zippo Encore Facebook page prior to the event for a chance to win a ticket or pass for each festival and other prizes throughout the summer.<br><br></p>    \r\n</div>\r\n\r\n\r\n\r\n<div style="padding-left: 20px; padding-right: 30px;">\r\n\r\n<p></p><p style="font-size: 22px; color: #000000;"><b><span style="color: #ff0000;">#SHARETHEPAIN </span> WITH US</b></p>\r\n<font color="#a7a7a7">\r\n<p style="font-size: 16px">April 3, 2014 - Have you ever lost a Zippo lighter?  Do you know somebody who has?  <br> Did it hurt?</p>  \r\n\r\n<p><img height="200px" align="left" style="padding:8px;" src="/images/editorials/1_1603_AV_jaxmcflame.jpg"></p>\r\n<p style="font-size: 14px;"><br><br>If you can answer “yes” to any of these then you need to get to <a style="color: #ff0000;" "target="none" href="www.sharethepain.com">sharethepain.com</a> where you can commiserate with our grief-counselor-meets-tough-guy, Jax ‘No Pain’ McFlame. While immune to physical pain, the emotional pain of losing a Zippo lighter can break him.  \r\nJax want to hear about the lighters you’ve lost so he can start you through the healing process.  Jax may have some strong opinions about what you’ve lost.  Head to <a style="color: #ff0000;" "target="none" href="www.sharethepain.com">sharethepain.com</a> or to Twitter to <a style="color: #ff0000;" "target="none" href="www.twitter.com">#ShareThePain</a> and see what he has to say.<br><br><br><br></p></font></div><font color="#a7a7a7">\r\n\r\n\r\n\r\n<div style="padding-left: 20px; padding-right: 30px;">\r\n\r\n\r\n<p></p><p style="font-size: 18px; color: #000000;"><b>Zippo Extends NASCAR Sponsorship</b></p>\r\n<img height="175px" align="left" style="padding:8px;" src="/images/editorials/1_1603_AV_Zippo200.jpg">\r\n<p>March 1, 2014 - Zippo has signed a multi-year renewal, extending sponsorship of the Zippo 200 at The Glen NASCAR Nationwide Series race through 2016.  Now in its tenth year, the Zippo 200 is the third longest running Nationwide Series race under the same name and sponsorship. <br><br>\r\n“From the beginning, our partnership with Watkins Glen International has been a great fit for both of us,” commended Greg Booth, Zippo president and CEO.  “Racing fans, especially NASCAR fans, have the same loyalty and passion for their sport as Zippo lighter fans have for our product.  Our Zippo Outdoor products make even more sense as we reach out to thousands of avid fans who pack the campgrounds during the race weekend at the Glen.”  \r\nThe NASCAR Sprint Cup Series weekend at <a style="color: #ff0000;" "target="none" href="http://www.theglen.com/Tickets-Events/Events/2014/Cheez-It-355-at-The-Glen.aspx?#NASCAR"> The Glen is August 7 &ndash; 10. </a>  <br><br><br></p></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p></p><p style="font-size: 18px; color: #000000;"><b> Zippo Takes over Product Distribution in Europe</b></p>\r\n<font color="#a7a7a7">\r\n<p>\r\n\r\n</p><p>July 18, 2013 &ndash; Zippo Manufacturing Company will take full control of its product distribution in Europe according to an announcement made by Zippo and Polyconcept.  Zippo will take over Polyconcept’s stake in Austria, Benelux, France, and Germany.  As part of the agreement, Zippo GMBH and Zippo SA, will now be known as Zippo France and Zippo Germany. </p>\r\n\r\n<p><img height="100px" align="left" style="padding:8px;" src="/images/editorials/1_1603_AV_SmGregBooth.png?"></p>\r\n\r\n<p><br>Greg Booth, Zippo President and CEO said, “Over the past 20 years Polyconcept and Zippo have worked well together  to distribute Zippo products in Europe. As the companies  have evolved, we realised that this change will contribute  to an enhanced service to our customers. We hold Polyconcept in the highest  regards and are grateful for the opportunity  to have worked together  and  for their contribution to Zippo’s success story in Europe.”</p>\r\n\r\n<p>“Many important changes have taken place over the past few years; all of which have demonstrated Zippo’s commitment to growth, market leadership, and our vision of the future,” said Booth.</p>\r\n\r\n\r\n\r\n\r\n<br>\r\n<p style="font-size: 18px; color: #000000;"><b> Zippo Makes Top Ten List of Most ''Patriotic'' Brands</b></p>\r\n<font color="#a7a7a7">\r\n<p>\r\n</p><p><img height="250px" align="left" style="padding:8px;" src="/images/editorials/1_1603_AV_ZippoJeep.jpg"></p>\r\n<p>\r\nJune 4, 2013 - Zippo was named one of the top ‘Americana’ brands in a survey of 4,500 consumers by New York-based branding researching firm Brand Keys. Zippo weighed in at number seven on the list, boasting a 93 percent score (out of 100) on a scale representing consumers'' emotional engagement expectations.  \r\n</p>\r\n<p>\r\nZippo has been an American icon since WWII when the company ceased production of lighters for consumer markets and dedicated all manufacturing to the <a style="color: #ff0000;" target="none" href="http://www.zippo.com/lighters.aspx?id=1226&amp;c=1230&amp;o=1536"> U.S. military</a>. The company has produced countless <a style="color: #ff0000;" target="none" href="http://www.zippo.com/lighters.aspx?id=1226&amp;c=1230&amp;t=1309"> American</a> themed lighters, the single most popular image reproduced on the windproof lighter being the <a style="color: #ff0000;" target="none" href="http://www.zippo.com/product.aspx?id=1025455"> Statue of Liberty</a>. Additionally, the people of Zippo contribute to its patriotic history &ndash; including its founder, George G. Blaisdell, the many employees, as well as the customers and collectors who have played a part in the company’s 80-year history. \r\n</p>\r\n<p>\r\n“Everyone has a Zippo story. It''s an attitude, a lifestyle -- it''s an American icon, like a July 4th backyard barbeque,” said Greg Booth, Zippo President and Chief Executive Officer. “We’re honored to be on this list and I know Zippo founder <a style="color: #ff0000;" target="none" href="http://www.zippo.com/product.aspx?id=1025788"> George G. Blaisdell</a> would say the same. Mr. Blaisdell was a very proud American and many times he said that he was privileged to pay his Federal taxes because he felt that the United States was such a great country.”\r\n</p>\r\n<p>\r\nZippo embodies American pride not only in its design and manufacturing, but also through partnerships with companies and brands that share its patriotic values. More than half of the brands on the Brand Keys list have been featured on a Zippo lighter, including Jeep which came in at number one. In fact, in 2011, West Coast Customs produced a custom <a style="color: #ff0000;" target="none" href="http://www.zippo.com/product.aspx?id=1025964"> Zippo Jeep</a>. In addition, <a style="color: #ff0000;" target="none" href="http://www.zippo.com/lighters.aspx?id=1226&amp;c=1230&amp;t=1300"> Harley-Davidson Motor Company</a>, ranked 13 on the list, is currently Zippo’s number one licensed brand.\r\n</p>\r\n\r\n\r\n<div style="padding-left: 0px; padding-right: 30px;">\r\n\r\n                            </div>\r\n                            <!-- eo .inner -->\r\n                        </font></font></font></section><!-- eo .wholeContent --><font color="#a7a7a7"><font color="#a7a7a7"><font color="#a7a7a7">\r\n                        <section class="btmPromo clear clearfix">\r\n                            <div class="promoInner clearfix">\r\n                                <h3 class="txtBebas txtBlack">Zippo eGift Card</h3>\r\n                                <p class="txtBold txtA7">Give the perfect gift that is sure to please every time.  Let them choose <br> the gift they want with a Zippo eGift Card.  </p>\r\n                                 <img width="195" alt="" src="http://images.zippo.com/images/c9/1_270.jpg">\r\n                                <a class="txtBebas" title="" href="http://zippo.com/giftcards">Shop Now</a> </div>\r\n                        </section>\r\n                    </font></font></font></div><font color="#a7a7a7"><font color="#a7a7a7"><font color="#a7a7a7">\r\n                    <!-- eo .wholeInner -->\r\n                </font></font></font></div><font color="#a7a7a7"><font color="#a7a7a7"><font color="#a7a7a7">\r\n                <!-- eo .wholeMain -->\r\n            </font></font></font></section>', '2014-09-20 00:47:45', '2014-09-20 00:58:05', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(13, 'Then and Now', 'one_column', NULL, NULL, 'then-and-now', NULL, '<div class="wholeMain clearfix">\r\n<div class="wholeInner clearfix">\r\n<h2 class="wholeHdr txtBebas">ABOUT US</h2>\r\n{{block type="cms/block" block_id="about-left-nav"}}\r\n<div class="inner clearfix">\r\n<h3 class="hdrWholeCont txtRed txtBebas">Then and Now</h3>\r\n<p><img src="/images/editorials/1_1574_AV_Banner.jpg" alt="" /></p>\r\n<br /> The story of Zippo Manufacturing Company is the story of its people, from the founder, George G. Blaisdell, to the many Zippo employees, customers, and collectors who have played a part in its 80-year history. Their loyalty to Zippo has made this one of America&rsquo;s great companies, one with a vivid history which is detailed here. <br /><br /> <strong>1930s</strong> <br /><br /> The Zippo timeline begins in the early 1930s, at the Bradford Country Club in Bradford, Pennsylvania. Mr. Blaisdell watched a friend awkwardly using a cumbersome Austrian-made lighter. The lighter worked well, even in the wind, due to the design of the chimney. But its appearance was utilitarian. Its use required two hands, and its thin metal surface dented easily. <br /><br /> Late in 1932, he decided to refashion the Austrian lighter. Mr. Blaisdell fabricated a rectangular case and attached the top of the lighter to the case with a hinge. He retained the chimney design which protected the flame under adverse conditions. The result was a lighter that looked good and was easy to operate. The first Zippo lighter, currently displayed at the <a style="color: #df101d;" href="http://www.zippo.com/about/article.aspx?id=1584" target="none">Zippo/Case Museum</a> in Bradford, was produced in early 1933 and sold for $ 1.95 each. And, from the very beginning, they were backed by Mr. Blaisdell&rsquo;s unconditional lifetime guarantee &ndash; &ldquo;It works or we fix it free. &trade;&rdquo; The name &ldquo;Zippo&rdquo; was created by Mr. Blaisdell. He liked the sound of the word &ldquo;zipper&rdquo; so he formed different variations of the word and settled on &ldquo;Zippo,&rdquo; deciding that it had a &ldquo;modern&rdquo; sound. <br /><br />Application for the original Zippo patent was filed on May 17, 1934, and patent number 2032695 was granted on March 3, 1936. A second patent, number 2517191 was issued on August 1, 1950. The design of the Zippo lighter remains basically the same to this day, with minor improvements. In the mid-30s, Bradford&rsquo;s Kendall Refining Company placed an order for 500 Zippo lighters. These are believed to be the first company-advertised lighters produced by Zippo and are highly collectible. Today, companies continue to use Zippo lighters as an advertising medium and Zippo &ldquo;advertiser&rdquo; lighters continue to be among collectors&rsquo; favorites.\r\n<p>&nbsp;</p>\r\n<center><img src="/images/editorials/1_1574_AV_KENDALL.jpg?91\r\n" alt="" /></center>\r\n<p>&nbsp;</p>\r\n<br /><br /> Beginning in 1939, World War II had a profound effect on Zippo. Upon America&rsquo;s entry into the war, Zippo ceased production of lighters for consumer markets and dedicated all manufacturing to the U.S. military. The military initiative led to the production of the steel-case Zippo lighter with black crackle finish. The fact that millions of American military personnel carried the lighter into battle was a significant catalyst in establishing Zippo as an icon of America throughout the world. Supplying the military market resulted in full production for the plant. This enabled Zippo to be strong financially and made it a viable company. <br /><br /> <strong>1940s</strong> <br /><br /> At the end of the war in 1945, Zippo hit the road selling lighters to peacetime America. A promoter at heart, Mr. Blaisdell wanted to create a car that looked like a Zippo lighter. In 1947, the <a style="color: #df101d;" href="http://www.zippo.com/about/article.aspx?id=1583" target="none">Zippo Car </a>was born. <br /><br /> <strong>1950s / 1960s</strong> <br /><br /> Starting in the mid-50s, <a style="color: #df101d;" href="http://www.zippo.com/about/article.aspx?id=1582" target="none">date codes </a> were stamped on the bottom of every Zippo lighter. The original purpose was for quality control, but the codes have since become an invaluable tool for collectors. <br /><br /> The launch of the Slim model in 1956 was a major milestone. This version was designed to appeal primarily to women. The first non-lighter product was a steel pocket tape measure, or &ldquo;rule&rdquo; as it was called, introduced in 1962. Other items have been added and deleted from the Zippo line since the 1960s. Many were primarily geared to the promotional products division. The roster includes key chains, pocket knives, golf greenskeepers, pen-and-pencil sets and the ZipLight pocket flashlight. <br /><br /> Perhaps one of the biggest influences on collecting is <a style="color: #df101d;" href="http://www.zippo.com/about/starring_roles.aspx" target="none">Zippo&rsquo;s ties to Hollywood and Broadway.</a>The Zippo lighter has been featured in more than 1,500 movies, stage plays and television shows over the years. Zippo lighters have &ldquo;starred&rdquo; in such diverse productions as &ldquo;I Love Lucy&rdquo; &ldquo;The X-Men&rdquo; and &ldquo;Hairspray &ndash; the Musical.&rdquo; Often the lighter is a key prop, used as a device to move the plot forward or to reflect the personality of a character or time period being depicted. <br /><br /> On the music scene, Zippo lighters have been raised high since the 1960s as a salute to favorite performers, a gesture later dubbed the &ldquo;Zippo Moment&rdquo;. The famous Zippo &ldquo;click&rdquo; sound has been sampled on songs, and the lighters themselves have been featured on album covers, tattooed on rockers&rsquo; skin, and wielded in Rolling Stone photo shoots. With a rock resume like this, <a style="color: #df101d;" href="http://zippoencore.com/" target="none">ZippoEncore.com </a> was created to showcase the talents of undiscovered bands across the country. <br /><br /> <strong>1970s / 1980s</strong> <br /><br /> Mr. Blaisdell passed away on October 3, 1978. He is remembered not only for inventing the Zippo lighter, but also for his generous and kind spirit. After his passing, his daughters, Harriett B. Wick and Sarah B. Dorn, inherited the business. In the 1980s and 90s, the company was owned by six members of the Blaisdell family, including his daughters and their children. Today, George B. Duke, Mr. Blaisdell&rsquo;s grandson and Sarah Dorn&rsquo;s son, is the sole owner and Chairman of the Board. Gregory W. Booth is President and CEO. <br /><br /> In the 70s and 80s, Zippo greatly expanded its overseas sales and marketing efforts. As a result, Zippo lighters are now sold in over 160 countries. Strong sales in both the domestic market and emerging markets overseas, particularly China and India, contributed to record sales increases in 2011 and 2012. <br /><br /> <strong>1990s</strong> <br /><br /> In 1993, Zippo acquired W.R.Case and Sons Cutlery Company. Case manufactures premium hand-crafted knives, and offers a wide range of product categories, from traditional folding pocket knives and fixed blade sporting knives to limited-production commemoratives and collectibles. Established in 1889 and based in Bradford since 1905, Case has a rich heritage and many aficionados collect both Case knives and Zippo lighters. <br /><br /> It&rsquo;s estimated that there are some four million <a style="color: #df101d;" href="http://www.zippo.com/about/article.aspx?id=1581" target="none">Zippo collectors </a> in the United States and millions more around the world. Their fervor and dedication to the brand is unparalleled. To enhance the collecting experience, Zippo collector clubs around the world hold meet ups and other events throughout the year. <br /><br /> The <a style="color: #df101d;" href="http://www.zippo.com/about/article.aspx?id=1584" target="none">Zippo/Case Museum </a>opened in July 1997. The 15,000-square-foot facility includes a store, museum, and the famous Zippo Repair Clinic, where the Zippo lighter repair process is on display. The Zippo/Case Museum Store was remodeled early in 2012 with textures like brick, metal, and leather; a wooden runway leading to the centrally located cash wrap illuminated by pendant drop lights that resemble fire; a combination of vintage artwork and lifestyle photography; and display shelves resembling the Zippo bottom stamp.\r\n<p>&nbsp;</p>\r\n<center><img src="/images/editorials/1_1574_AV_MUSEUM.jpg?887" alt="" /></center>\r\n<p>&nbsp;</p>\r\n<br /><br /> <strong>2000 to Today</strong> <br /><br /> In the fall of 2002, Zippo obtained trademark registration for the shape of the Zippo lighter. This was a major milestone in helping Zippo protect the brand from counterfeiters. Zippo also launched a major new product category with the Zippo MPL&reg;, multi-purpose lighter, a refillable butane utility-style lighter. Since then, several new products have been added to the multi-purpose lighter line. <br /><br /> The Zippo windproof lighter has been a staple necessity for outdoor adventures since . . . well, for more than 80 years. There are many stories of how the light, heat, or case of a Zippo lighter saved the day or saved a life in the company archives. In 2010, the company introduced an all-metal <a style="color: #df101d;" href="http://www.zippo.com/product.aspx?id=1023911" target="none">hand warmer </a>that operates on Zippo premium lighter fluid and keeps hands warm longer than any other product on the market. In 2011, an <a style="color: #df101d;" href="http://www.zippo.com/product.aspx?id=1025615" target="none">emergency fire starter kit </a>and <a style="color: #df101d;" href="http://www.zippo.com/product.aspx?id=1023901" target="none">flex neck utility lighter </a>were added to the roster of Zippo Outdoor products. As the Outdoor products continue to show very strong sales worldwide, Zippo is developing a Zippo- branded line of robust camping gear and fire accessories scheduled to be introduced later in 2013. <br /><br /> Zippo&rsquo;s diverse product line continues to grow, and now includes lighter accessories; butane candle lighters; watches, men''s and women''s fragrance, and lifestyle accessories for men; and the developing line of heat and flame products for outdoor enthusiasts. Zippo also owns the Ronson brand of lighters and fuel. <br /><br /> In 2012, during its 80th anniversary year, Zippo production surpassed the milestone of 500 million lighters since Mr. Blaisdell crafted the first lighter in early 1933. The lighter is ingrained in the fabric of both American and global culture. In marketing parlance, the brand enjoys an unaided awareness rate of more than 98 percent. That means 98 out of every 100 people surveyed have knowledge of the Zippo name and lighter without being coached in any manner &ndash; an astonishing recognition factor. <br /><br /> Today, though most products are simply disposable or available with limited warranties, the Zippo lighter is still backed by its famous lifetime guarantee, &ldquo;It works or we fix it free.&trade;&rdquo; In more than 80 years, no one has ever spent a cent on the mechanical repair of a Zippo lighter regardless of the lighter&rsquo;s age or condition.</div>\r\n<!-- eo .inner --> <!-- eo .wholeContent -->\r\n<div class="promoInner clearfix">\r\n<h3 class="txtBebas txtBlack">Zippo eGift Card</h3>\r\n<p class="txtBold txtA7">Give the perfect gift that is sure to please every time. Let them choose <br /> the gift they want with a Zippo eGift Card.</p>\r\n<img src="http://images.zippo.com/images/c9/1_270.jpg" alt="" width="195" /> <a class="txtBebas" title="" href="http://zippo.com/giftcards">Shop Now</a></div>\r\n</div>\r\n<!-- eo .wholeInner --></div>\r\n<!-- eo .wholeMain -->', '2014-09-20 12:34:05', '2014-09-20 12:37:07', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(14, 'Date Codes', 'one_column', NULL, NULL, 'date-codes', NULL, '<section class="wholePage clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">ABOUT US </h2>\r\n                        <nav class="leftInnerNav txtBebas"> {{block type="cms/block" block_id="about-left-nav"}}</nav>\r\n                        <section id="aboutContent" class="wholeContent">\r\n                            <div class="inner clearfix">\r\n                                <h3 class="hdrWholeCont txtRed txtBebas">\r\n                                    Date Codes</h3>\r\n                                <p>As with most collectibles, the date of manufacture of a Zippo lighter often affects its value.  Valuable information on the bottom of every Zippo windproof lighter can help you determine its date of manufacture.  Starting in the mid 50s, date codes were stamped on the bottom.  The original purpose was for quality control.  The date codes have since become an invaluable tool for Zippo collectors.Most lighters fabricated between 1933 and 1957 can be identified by style and model and the patent or patent-pending marks.  </p>\r\n<p>The appearance of the word "Zippo" in the bottom stamp provides another clue to dating.  There have been three major changes, as show in inset.  From 1933 to the mid 50s, the word Zippo was stamped in block letters.  The Zippo script logo was developed in the late 40s and was phased-in on the lighter bottom stamp around 1955.  In the late 70s the logo was redesigned.  It was incorporated into the bottom stamp in 1980.  </p>\r\n\r\n<p>What began as a quality-control tool for Zippo founder George G. Blaisdell has become a collector’s dream. To identify a potential pattern in any run of lighters returned for repair, the bottom of every Zippo lighter was encoded with a series of markings. Since the 1950s, those markings provide a way to accurately date most Zippo lighters. The world-famous guarantee that It works or we fix it free&trade; still covers every Zippo windproof pocket lighter today. If your Zippo lighter needs repair, send via a trackable method to Zippo Repair Clinic, 1932 Zippo Drive, Bradford, PA 16701.</p>\r\n\r\n<p><font size="3" color="red">ZIPPO SLIM LIGHTER IDENTIFICATION CODES</font></p>\r\n<p><left><img width="700px" ;="" src="/images/editorials/1_1582_AV_DateCodeSlim.png"></left>\r\n</p><p><font size="3" color="red">ZIPPO REGULAR LIGHTER IDENTIFICATION CODES</font></p>\r\n<p><left><img width="700px" ;="" src="/images/editorials/1_1582_AV_DateCodeBigger.png"></left></p>\r\n<p><left><img height="400px" ;="" src="/images/editorials/1_1582_AV_bottom.png"></left></p>\r\n<img ''="" src="/images/editorials/1_1582_AV_logos.png">\r\n                            </div>\r\n                            <!-- eo .inner -->\r\n                        </section><!-- eo .wholeContent -->\r\n                        <section class="btmPromo clear clearfix">\r\n                            <div class="promoInner clearfix">\r\n                                <h3 class="txtBebas txtBlack">Zippo eGift Card</h3>\r\n                                <p class="txtBold txtA7">Give the perfect gift that is sure to please every time.  Let them choose <br> the gift they want with a Zippo eGift Card.  </p>\r\n                                 <img width="195" alt="" src="http://images.zippo.com/images/c9/1_270.jpg">\r\n                                <a class="txtBebas" title="" href="http://zippo.com/giftcards">Shop Now</a> </div>\r\n                        </section>\r\n                    </div>\r\n                    <!-- eo .wholeInner -->\r\n                </div>\r\n                <!-- eo .wholeMain -->\r\n            </section>', '2014-09-20 12:50:06', '2014-09-20 12:50:06', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
