ure to please every time.  Let them choose <br> the gift they want with a Zippo eGift Card.  </p>\r\n                                 <img width="195" alt="" src="http://images.zippo.com/images/c9/1_270.jpg">\r\n                                <a class="txtBebas" title="" href="http://zippo.com/giftcards">Shop Now</a> </div>\r\n                        </section>\r\n                    </div>\r\n                    <!-- eo .wholeInner -->\r\n                </div>\r\n                <!-- eo .wholeMain -->\r\n            </section>', '2014-09-20 13:22:56', '2014-09-20 13:22:56', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(16, 'Store Information', 'one_column', NULL, NULL, 'store-information', NULL, '<section class="wholePage clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">Customer Care </h2>\r\n                        <nav class="leftInnerNav txtBebas">\r\n{{block type="cms/block" block_id="customer-care"}}\r\n</nav>\r\n                        <section class="wholeContent" id="aboutContent">\r\n                            <div class="inner clearfix">\r\n                                <h3 class="hdrWholeCont txtRed txtBebas">Orders / Cancellations</h3>\r\n<p>A valid email address is needed to place an order online. If you do not have a valid email address, you can place your order by calling 888-442-1932 or 814-368-2700 Monday through Friday 8 a.m. to 4:30 p.m. EST. </p>\r\n\r\n<p>Your Zippo order is processed immediately; therefore, we cannot accommodate any changes or cancellations.  If the order has already been processed and you still wish to return it, simply follow the instructions in the Returns and Exchanges section. Shipping and handling charges are not refundable. </p>\r\n\r\n<p>If you have registered as a Zippo.com customer, you can check the status of your order by logging into your profile.   You are responsible for maintaining the confidentiality of your password and account information. Furthermore, you are responsible for all activities that occur in your account and agree to notify us immediately of any unauthorized use of your account. We are not responsible for any loss that you may occur as a result of any unauthorized person using your account or your password. </p>\r\n\r\n\r\n\r\n  \r\n<h3 class="hdrWholeCont txtRed txtBebas">Sales Tax</h3>\r\n<p>Zippo is required to collect sales tax for deliveries to all states except DE, MT, ND, NH, OR, and AK. All states require sales tax be added to the order before shipping charges are added except for the following states that must add sales tax to the total order including the shipping and handling charges: AR, CO, CT, GA, HI, KS, MI, MS, NC, NE, NM, NV, NY, PA, SD, TX, WA, WI, and WV. Sales tax is calculated using the address where the product is being shipped. </p>\r\n\r\n<h3 class="hdrWholeCont txtRed txtBebas">Shipping and Handling</h3>\r\n<p>Properly completed orders will be shipped according to the service guidelines listed below. Orders are properly completed after credit card authorizations are obtained and shipping address is confirmed. In addition Zippo reserves the right to hold any order for suspected fraud. Orders that cannot be properly completed will be cancelled and the customer will be notified.  </p>\r\n\r\n<p>We are happy to ship items to multiple addresses. Orders to multiple addresses must be placed separately. Shipping and handling rates apply for each delivery address. </p>\r\n<br>\r\n<p>We are happy to ship to addresses within the United States. If you are outside of the U.S., please visit the authorized Zippo retailer in your country. We can not ship to P.O. Boxes, Alaska, Hawaii, and U.S. Territories. </p>\r\n\r\n<p>There are several products that carry extra shipping fees, even if the rest of the order is eligible for free standard shipping. These include any fuel items: lighter fluid, All-in-one gift set, Classic and Slim lighter gift sets, Fire Gift Set, Heat Gift Set; as well as any oversized items: 4-in-1 Woodsman&reg;, Black Display Box, 10-piece or 25-piece Oak Counter Display, Neon Clock, or Flame Light Box. Surcharges also apply to shipments to Alaska or Hawaii. If you are eligible for FREE STANDARD SHIPPING, the regular shipping rate will be free, but you will still see a small shipping charge for any of these items.</p>\r\n\r\n<p>After credit card verification, your order will be shipped from Bradford, Pennsylvania within 3 to 5 business days.  You can check on current order status by <a href="https://www.zippo.com/customercare/ordertracking.aspx" target="none" style="color: #df101d;"> clicking here </a></p>\r\n\r\n<p>Need your order right away? Two to three day and next day shipping options are available. Completed orders received prior to 10 a.m. Eastern Standard Time will be processed by the next business day. Delivery signature is required. </p>\r\n<p>Not valid in Alaska, Hawaii, U.S. Territories, and APO/FPO addresses.\r\nProducts containing lighter fluid or butane can only be shipped standard ground shipping.</p> \r\n\r\n<p>Orders are shipped Monday through Friday only.  We are closed major holidays: New Years Day, Easter, Labor Day, Thanksgiving, and Christmas. </p>\r\n\r\n\r\n<h3 class="hdrWholeCont txtRed txtBebas">Returns and Exchanges</h3>\r\n<p>Zippo products are manufactured with quality and integrity. If you feel the need to return or exchange an item based on the guidelines below, we will gladly process your return within 30 days from the order ship date.  Merchandise damaged by abuse, misuse, normal wear and tear, or lack of reasonable care is not covered by the manufacturer''s warranty and cannot be returned at any time after purchase. If you purchased your Zippo product from an authorized Zippo retailer, contact that retailer for details on their return policy.</p>\r\n\r\n<p>To return product, include a copy of your packing slip and the reason for your return. If you do not have a copy of your packing slip please include the original order number, purchaser name, address, and telephone number along with the reason for your return. Merchandise returned for credit must be in new, unused condition.</p>\r\n\r\n<p>If you do not have your original packing slip, use the merchandise return form <a href="/pdf/pj14378-ReturnForm_v5.pdf" target="_blank" style="color: #df101d;"> here </a> . Please print off and return with your merchandise to the address below.\r\n\r\nRepair Form <a href="/images/editorials/1_1579_PDF_Repair Form.pdf" target="_blank" style="color: #df101d;"> here.</a> Pack your return with the completed form and send it to: \r\n<br>\r\n<br>\r\n<br>Zippo.com Return<br>\r\n401 Congress Street <br>\r\nBradford PA, 16701<br>\r\n\r\n</p>\r\n\r\n<p><b><u>IMPORTANT NOTES:</u></b>\r\n</p><ul>\r\n<li>We do not accept C.O.D. deliveries. </li><br>\r\n<li>You must include a return address. For the safety of our employees, any package received without a return address on the outside of the package will be destroyed, and Zippo will not replace the contents of the package. Thank you for your cooperation. </li>\r\n<li>Exchanges are subject to availability. A refund will be processed if the product is unavailable. </li>\r\n<li>Engraved or customized merchandise cannot be returned or exchanged. </li>\r\n<p></p>\r\n<p>Upon receipt of products, refunds will be processed to the form of payment used on the original order. For credit card refunds, allow up to two billing cycles for the credit to appear on your statement. If you return a product purchased with a check or money order as payment, a check will be issued and mailed to you within two weeks of receipt of returned product. Refunds will include product and sales tax amount only. In the event that an incorrect item was shipped, or if products were damaged in transit, we will also include shipping charges in your refund. </p>\r\n\r\n                            </p></ul></div>\r\n                            <!-- eo .inner -->\r\n                        </section><!-- eo .wholeContent -->\r\n                    </div>\r\n                    <!-- eo .wholeInner -->\r\n                </div>\r\n                <!-- eo .wholeMain -->\r\n            </section>', '2014-09-20 13:28:43', '2014-09-23 00:21:20', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(17, 'Product Instructions', 'one_column', NULL, NULL, 'product-intructions', NULL, '<section class="wholePage clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">Customer Care </h2>\r\n                        <nav class="leftInnerNav txtBebas">{{block type="cms/block" block_id="customer-care"}}</nav>\r\n                        <section id="aboutContent" class="wholeContent">\r\n                            <div class="inner clearfix">\r\n                                <iframe width="704px" height="510px" frameborder="0" seamless="seamless" scrolling="no" src="http://productinstructions.zippo.com/tabs/ProductInstructions.aspx">\r\n                            &lt;/div&gt;\r\n                            &lt;!-- eo .inner --&gt;\r\n                        &lt;/section&gt;&lt;!-- eo .wholeContent --&gt;\r\n                    &lt;/div&gt;\r\n                    &lt;!-- eo .wholeInner --&gt;\r\n                &lt;/div&gt;\r\n                &lt;!-- eo .wholeMain --&gt;\r\n            &lt;/section&gt;&lt;!-- eo .wholePage --&gt;\r\n        &lt;/div&gt;\r\n        &lt;!-- eo #main --&gt;\r\n    &lt;/div&gt;\r\n    &lt;!-- #container --&gt;\r\n    &lt;footer id="ftrSite" class="ftrSite"&gt;\r\n                &lt;div class="container ftrInner clearfix"&gt;\r\n        	        &lt;section class="ftrLeft"&gt;\r\n            	        &lt;span&gt;&amp;copy; 2014 Zippo Manufacturing Company&lt;/span&gt;\r\n                    &lt;/section&gt;\r\n                    &lt;nav id="ftrSocial" class="ftrSocial"&gt;\r\n                        &lt;a href="http://www.zippo.com/privacy.aspx" class="ftrPrivacy"&gt;&lt;span&gt;Privacy &lt;br /&gt; AND Legal&lt;/span&gt;&lt;/a&gt;\r\n            	        &lt;a href="http://www.zippoencore.com" target="_blank" class="ftrEncore" title="Zippo Encore"&gt;&lt;/a&gt;\r\n            	        &lt;a href="http://www.facebook.com/Zippo" target="_blank" class="ftrFB" title="Zippo on Facebook"&gt;&lt;/a&gt;\r\n            	        &lt;a href="http://www.youtube.com/zippo" class="ftrYouTube" target="_blank" title="Zippo YouTube Channel"&gt;&lt;/a&gt;\r\n            	        &lt;a href="http://www.instagram.com/originalzippo" class="ftrInstagram" target="_blank" title="Zippo Instagram Feed"&gt;&lt;/a&gt;\r\n            	        &lt;a href="http://twitter.com/#!/zippo" class="ftrTwitter" target="_blank" title="Zippo on Twitter"&gt;&lt;/a&gt;\r\n                    &lt;/nav&gt;\r\n                &lt;/div&gt;\r\n            &lt;/footer&gt;\r\n    &lt;script src="//ajax.googleapis.com/ajax/libs/jquery/1.6.2/jquery.min.js"&gt;&lt;/script&gt;\r\n    &lt;script src="//ajax.googleapis.com/ajax/libs/jqueryui/1.8.13/jquery-ui.min.js"&gt;&lt;/script&gt;\r\n    &lt;script&gt;window.jQuery || document.write("&lt;script src=''/assets/js/jquery-1.6.2.min.js''&gt;\\x3C/script&gt;&lt;script src=''/assets/js/jquery-ui-1.8.13.core.min.js''&gt;\\x3C/script&gt;")&lt;/script&gt;\r\n    &lt;script src="/assets/js/plugins.js"&gt;&lt;/script&gt;\r\n    &lt;script src="/assets/js/script.js"&gt;&lt;/script&gt;\r\n    &lt;!-- Google Code for Remarketing tag --&gt;\r\n    &lt;script type="text/javascript"&gt;\r\n        /* &lt;![CDATA[ */\r\n        var google_conversion_id = 1034274074;\r\n        var google_conversion_label = "g7nvCNLwrQQQmoqX7QM";\r\n        var google_custom_params = window.google_tag_params;\r\n        var google_remarketing_only = true;\r\n        /* ]]&gt; */\r\n    &lt;/script&gt;\r\n    &lt;script type="text/javascript" src="//www.googleadservices.com/pagead/conversion.js"&gt;&lt;/script&gt;\r\n    &lt;noscript&gt;\r\n        &lt;div style="display: inline;"&gt;\r\n            &lt;img height="1" width="1" style="border-style: none;" alt="" src="//googleads.g.doubleclick.net/pagead/viewthroughconversion/1034274074/?value=0&amp;amp;label=g7nvCNLwrQQQmoqX7QM&amp;amp;guid=ON&amp;amp;script=0" /&gt;\r\n        &lt;/div&gt;\r\n    &lt;/noscript&gt;\r\n    &lt;!-- Listrak Analytics &ndash; Script Source--&gt;\r\n    &lt;script type="text/javascript"&gt;\r\n        var biJsHost = (("https:" == document.location.protocol) ? "https://" : "http://");\r\n        document.write(unescape("%3Cscript src=''" + biJsHost + "s1.listrakbi.com/scripts/script.js?m=9tSz2UKKDXut&amp;v=1'' type=''text/javascript''%3E%3C/script%3E"));\r\n    &lt;/script&gt;\r\n    &lt;!-- Listrak Analytics - Submit Tracking Click--&gt;\r\n    &lt;script type="text/javascript"&gt;\r\n        _ltk.Click.Submit();\r\n    &lt;/script&gt;\r\n&lt;/body&gt;\r\n&lt;/html&gt;\r\n</iframe></div></section></div></div></section>', '2014-09-20 13:43:24', '2014-09-20 13:54:47', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(18, 'Safety Data', 'one_column', NULL, NULL, 'safety-data', NULL, '<section class="wholePage clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">Customer Care </h2>\r\n                        <nav class="leftInnerNav txtBebas">{{block type="cms/block" block_id="customer-care"}}</nav>\r\n                        <section id="aboutContent" class="wholeContent">\r\n                            <div class="inner clearfix">\r\n                                <h3 class="hdrWholeCont txtRed txtBebas"> </h3>\r\n<p>For the safety of our consumers, employees, and emergency personnel, we are making these Safety Data Sheets (SDS) available to provide information regarding the properties and procedures for safely handling or working with Zippo products.</p>\r\n\r\n<iframe width="610px" height="320px" frameborder="0" src="http://certification.zippo.com/sds.aspx"></iframe>\r\n\r\n\r\n                            </div>\r\n                            <!-- eo .inner -->\r\n                        </section><!-- eo .wholeContent -->\r\n                    </div>\r\n                    <!-- eo .wholeInner -->\r\n                </div>\r\n                <!-- eo .wholeMain -->\r\n            </section>', '2014-09-20 13:55:46', '2014-09-20 13:55:46', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(19, 'Repairs', 'one_column', NULL, NULL, 'repairs', NULL, '<section class="wholePage clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">Customer Care </h2>\r\n                        <nav class="leftInnerNav txtBebas">{{block type="cms/block" block_id="customer-care"}}</nav>\r\n                        <section id="aboutContent" class="wholeContent">\r\n                            <div class="inner clearfix">\r\n                                <h2 style="font-size: 16px; margin: 0 0 12px;" class="txtRed txtBebas">Repairs</h2>\r\n                                <p class="txtBold txtA7">In the unlikely event that your Zippo product will need repaired, bring it to the Zippo/Case Museum in Bradford, Pennsylvania and watch the technicians in the Repair Clinic repair your Zippo product. Viewing is available Monday through Friday from 9 a.m. to 3:30 p.m. EST. Of course, if you can''t make the trip to the Zippo/Case Museum, you can always send it to us for repair. Follow the repair instructions for your particular product below prior to sending any product for to us. </p>\r\n                                <p class="txtBold txtA7">If you have questions about your Zippo product repair, visit the \r\n                                    <a style="text-decoration: underline" class="txtA7" href="/customercare/article.aspx?id=1796">Frequently Asked Questions</a> or <a style="text-decoration: underline" class="txtA7" href="/customercare/contact_us.aspx">Contact Us</a>. </p>\r\n                                <section class="repairTabsHolder clearfix" id="repairTabsHolder">\r\n                                    <div class="repairTabs ui-tabs ui-widget ui-widget-content ui-corner-all" id="repairTabs">\r\n                                        <ul class="txtBebas clearfix repairTabsUl ui-tabs-nav ui-helper-reset ui-helper-clearfix ui-widget-header ui-corner-all">\r\n                                            <li style="margin-left: 12px;" class="ui-state-default ui-corner-top ui-tabs-selected ui-state-active"><a href="#tabs-lighters">Lighters</a></li>\r\n                                            <li class="ui-state-default ui-corner-top"><a href="#tabs-outdoors">Outdoor</a></li>\r\n                                            <li class="ui-state-default ui-corner-top"><a href="#tabs-watches">Watches</a></li>\r\n                                            <li class="ui-state-default ui-corner-top"><a href="#tabs-writing">Writing</a></li>\r\n                                        </ul>\r\n                                        <div class="repairTab clearfix ui-tabs-panel ui-widget-content ui-corner-bottom" id="tabs-lighters">\r\n                                            <ul class="repairLighters clearfix" id="repairLighters">\r\n                                                <li class="active" id="liLtWindproof"><a id="lnkLtWindProof" class="txtBebas txtBlack" href="#pnlWindproof">\r\n                                                    <img width="128" height="179" alt="windproof" src="/assets/img/repairs_windproof.jpg">\r\n                                                    Windproof </a></li>\r\n                                                <li id="liLtBlu"><a id="lnkLtBlu" class="txtBebas txtBlack" href="#pnlBlu">\r\n                                                    <img width="128" height="179" alt="blu" src="/assets/img/repairs_blu.jpg">\r\n                                                    Blu&reg; </a></li>\r\n                                                <li id="liLtUtility"><a id="lnkLtUtility" class="txtBebas txtBlack" href="#pnlUtility">\r\n                                                    <img width="128" height="179" alt="utility" src="/assets/img/repairs_utility.jpg">\r\n                                                    Utility </a></li>\r\n                                                <li id="liLtCandle"><a id="lnkLtCandle" class="txtBebas txtBlack" href="#pnlCandle">\r\n                                                    <img width="128" height="179" alt="candle" src="/assets/img/repairs_candle.jpg">\r\n                                                    Candle </a></li>\r\n                                            </ul>\r\n                                            <div id="ltRepairPanels" class="ltRepairPanels clearfix clear">\r\n                                                <div class="repLtPanel clearfix active" id="pnlWindproof">\r\n                                                    <div class="repairLtDesc">\r\n                                                        <h3 style="font-size: 18px;" class="txtBlack">Caring for Your Windproof Lighter</h3>\r\n                                                        <h4 style="font-size: 14px; margin: 0 0 12px;" class="txtRed">It works or we fix it free. &trade;</h4>\r\n                                                        <p class="txtBold txtA7">We don''t make that promise lightly. We know that behind every Zippo product sent for repair is an owner depending on our promise to get it back in working order. Whether a lighter is five years, 25 years, or 50 years old, it will serve as a dependable source of flame for years to come. We guarantee it. </p>\r\n                                                        <p class="txtRed"><em>Note: Please do not attempt to perform repairs yourself as it could damage the lighter beyond repair.</em> </p>\r\n                                                        <p class="txtBold txtA7">Your lighter will be repaired at no charge and returned promptly to you usually within 4-5 weeks. </p>\r\n                                                        <p class="txtBold txtA7"><a style="text-decoration: underline;" class="txtA7" href="/category.aspx?id=1222">Click here</a> to purchase flints, wicks, and Zippo Premium Lighter Fluid to keep your Zippo Windproof Lighter working efficiently. </p>\r\n                                                    </div>\r\n                                                    <!-- eo .repairLtDesc -->\r\n                                                    <div class="repairLtSteps">\r\n                                                        <div class="pad txtA7">\r\n                                                            <h4 style="font-size: 16px;">Follow these easy steps to return your product for repair:</h4>\r\n                                                            <h5 style="background: #000; color: #fff; float: left; font-size: 14px; margin: 12px 0 6px; padding: 1px 2px 2px;" class="txtBebas clear">Step #1</h5>\r\n                                                            <ul class="clear">\r\n                                                                <li><strong>Prepare your lighter for shipment. </strong></li>\r\n                                                                <li><strong>Remove the inside unit from the lighter. </strong></li>\r\n                                                                <li><strong>Allow all fuel to evaporate. </strong></li>\r\n                                                                <li><strong>Replace inside unit in lighter case. </strong></li>\r\n                                                            </ul>\r\n                                                            <h5 style="background: #000; color: #fff; float: left; font-size: 14px; margin: 12px 0 6px; padding: 1px 2px 2px;" class="txtBebas clear">Step #2</h5>\r\n                                                            <ul class="clear">\r\n                                                                <li><strong>Package your lighter securely in an oversized box or padded shipping bag. </strong></li>\r\n                                                                <li><strong><a class="txtA7" style="text-decoration: underline;" href="/pdf/PJ14744-RepairForm_v1.pdf">Click here</a> for a convenient form to include with your package or enclose a note with your name, address, telephone number, and email address to receive a confirmation of receipt and reshipment of your repaired item. </strong></li>\r\n                                                            </ul>\r\n                                                            <h5 style="background: #000; color: #fff; float: left; font-size: 14px; margin: 12px 0 6px; padding: 1px 2px 2px;" class="txtBebas clear">Step #3</h5>\r\n                                                            <ul class="clear">\r\n                                                                <li><strong>Customers in the US:<br>\r\n                                                                    Send your package to the Zippo Repair Clinic insured and via a trackable method to: </strong>\r\n                                                                    <span style="display: block;" class="txtRed txtBold">\r\n                                                                        Zippo Repair Clinic<br>\r\n                                                                        1932 Zippo Drive<br>\r\n                                                                        Bradford, PA 16701<br>\r\n                                                                    </span>\r\n                                                                </li>\r\n                                                                <li><strong>Customers in Europe:<br>\r\n                                                                    Send your package to the Zippo Repair Clinic insured and via a trackable method to: </strong>\r\n                                                                    <span style="display: block;" class="txtRed txtBold">\r\n                                                                        Zippo European Repair Clinic<br>\r\n                                                                        Groendahlscher Weg 87<br>\r\n                                                                        D-46446 Emmerich am Rhein, Germany<br>\r\n                                                                    </span>\r\n                                                                </li>\r\n                                                                <li><strong>Customers in other countries:<br>\r\n                                                                    Send your package to the Zippo Repair Clinic insured and via a trackable method to the distributor or service center for your country. <a class="txtA7" style="text-decoration: underline;" href="/international.aspx">Click here</a> for listing.</strong>\r\n                                                                </li>\r\n                                                            </ul>\r\n                                                        </div>\r\n                                                        <!-- eo .pad -->\r\n                                                    </div>\r\n                                                    <!-- eo .repairLtSteps -->\r\n                                                </div>\r\n                                                <!-- eo #pnlWindproof -->\r\n                                                <div class="repLtPanel clearfix" id="pnlBlu">\r\n                                                    <div class="repairLtDesc">\r\n                                                        <h3 style="font-size: 18px;" class="txtBlack">Caring for Your BLU&reg; Lighter</h3>\r\n                                                        <p class="txtRed"><em>Note: Please do not attempt to perform repairs yourself, as it could damage the product beyond repair. Do not attempt to remove the inside assembly. There are no user serviceable parts inside this lighter.</em> </p>\r\n                                                        <p class="txtBold txtA7">Your lighter will be repaired at no charge and returned promptly to you usually within 4-5 weeks. </p>\r\n                                                        <p class="txtA7 txtBold">\r\n                                                            These instructions apply to the Zippo BLU&reg; lighter only.  Please see other product categories for specific warranty information.\r\n                                                        </p>\r\n                                                        <p class="txtBold txtA7"><a style="text-decoration: underline;" class="txtA7" href="/category.aspx?id=1222">Click here</a> to purchase flints, wicks, and Zippo Premium Lighter Fluid to keep your Zippo Windproof Lighter working efficiently. </p>\r\n                                                    </div>\r\n                                                    <!-- eo .repairLtDesc -->\r\n                                                    <div class="repairLtSteps">\r\n                                                        <div class="pad txtA7">\r\n                                                            <h4 style="font-size: 16px;">BLU&reg; repair:</h4>\r\n                                                            <h5 style="background: #000; color: #fff; float: left; font-size: 14px; margin: 12px 0 6px; padding: 1px 2px 2px;" class="txtBebas clear">Step #1</h5>\r\n                                                            <ul class="clear">\r\n                                                                <li><strong>Prepare your lighter for shipment. </strong></li>\r\n                                                                <li><strong>Take lighter outdoors and discharge gas following the instructions in that came with your lighter or <a class="txtA7" style="text-decoration: underline;" href="/pdf/BluInstructionUSA.pdf">click here</a> for instructions.</strong></li>\r\n                                                            </ul>\r\n                                                            <h5 style="background: #000; color: #fff; float: left; font-size: 14px; margin: 12px 0 6px; padding: 1px 2px 2px;" class="txtBebas clear">Step #2</h5>\r\n                                                            <ul class="clear">\r\n                                                                <li><strong>Package your lighter securely in an oversized box or padded shipping bag.</strong></li>\r\n                                                                <li><strong><a class="txtA7" style="text-decoration: underline;" href="/pdf/PJ14744-RepairForm_v1.pdf">Click here</a> for a convenient form to include with your package or enclose a note with your name, address, telephone number, and email address to receive a confirmation of receipt and reshipment of your repaired item. </strong></li>\r\n                                                            </ul>\r\n                                                            <h5 style="background: #000; color: #fff; float: left; font-size: 14px; margin: 12px 0 6px; padding: 1px 2px 2px;" class="txtBebas clear">Step #3</h5>\r\n                                                            <ul class="clear">\r\n                                                                <li><strong>Customers in the US:<br>\r\n                                                                    Send your package to the Zippo Repair Clinic insured and via a trackable method to: </strong>\r\n                                                                    <span style="display: block;" class="txtRed txtBold">\r\n                                                                        Zippo Repair Clinic<br>\r\n                                                                        1932 Zippo Drive<br>\r\n                                                                        Bradford, PA 16701<br>\r\n                                                                    </span>\r\n                                                                </li>\r\n                                                                <li><strong>Customers in Europe:<br>\r\n                                                                    Send your package to the Zippo Repair Clinic insured and via a trackable method to: </strong>\r\n                                                                    <span style="display: block;" class="txtRed txtBold">\r\n                                                                        Zippo European Repair Clinic<br>\r\n                                                                        Groendahlscher Weg 87<br>\r\n                                                                        D-46446 Emmerich am Rhein, Germany<br>\r\n                                                                    </span>\r\n                                                                </li>\r\n                                                                <li><strong>Customers in other countries:<br>\r\n                                                                    Send your package to the Zippo Repair Clinic insured and via a trackable method to the distributor or service center for your country. <a class="txtA7" style="text-decoration: underline;" href="/international.aspx">Click here</a> for listing.</strong>\r\n                                                                </li>\r\n                                                            </ul>\r\n                                                        </div>\r\n                                                        <!-- eo .pad -->\r\n                                                    </div>\r\n                                                    <!-- eo .repairLtSteps -->\r\n                                                </div>\r\n                                                <!-- eo #pnlBlu -->\r\n                                                <div class="repLtPanel clearfix" id="pnlUtility">\r\n                                                    <div class="repairLtDesc">\r\n                                                        <h3 style="font-size: 18px;" class="txtBlack">Caring for Your Utility Lighter</h3>\r\n                                                        <p class="txtBold txtA7">The Zippo Utility Lighter is warranted for three years from the date of purchase with proof of purchase. Please include $5 for shipping and handling for each Utility Lighter sent.</p>\r\n                                                        <p class="txtBold txtA7">Your Utility Lighter will be promptly repaired or replaced. </p>\r\n                                                        <p class="txtBold txtA7"><a style="text-decoration: underline;" class="txtA7" href="/product.aspx?id=1024746">Click here</a> to purchase Zippo Premium Butane Fuel to keep your Zippo Utility Lighter working efficiently.</p>\r\n                                                    </div>\r\n                                                    <!-- eo .repairLtDesc -->\r\n                                                    <div class="repairLtSteps">\r\n                                                        <div class="pad txtA7">\r\n                                                            <h4 style="font-size: 16px;">Utility Lighter repair:</h4>\r\n                                                            <h5 style="background: #000; color: #fff; float: left; font-size: 14px; margin: 12px 0 6px; padding: 1px 2px 2px;" class="txtBebas clear">Step #1</h5>\r\n                                                            <ul class="clear">\r\n                                                                <li><strong>Prepare your Utility Lighter for shipment. </strong></li>\r\n                                                                <li><strong>Take lighter outdoors and discharge gas following the instructions in that came with your lighter or <a class="txtA7" style="text-decoration: underline;" href="/pdf/OULInstructionNAFTA.pdf">click here</a> for instructions.</strong></li>\r\n                                                            </ul>\r\n                                                            <h5 style="background: #000; color: #fff; float: left; font-size: 14px; margin: 12px 0 6px; padding: 1px 2px 2px;" class="txtBebas clear">Step #2</h5>\r\n                                                            <ul class="clear">\r\n                                                                <li><strong>Package your lighter securely in an oversized box or padded shipping bag with the information below and $5 shipping and handling.</strong></li>\r\n                                                                <li><strong><a class="txtA7" style="text-decoration: underline;" href="/pdf/PJ14744-RepairForm_v1.pdf">Click here</a> for a convenient form to include with your package or enclose a note with your name, address, telephone number, and email address to receive a confirmation of receipt and reshipment of your repaired item. </strong></li>\r\n                                                                <li><strong>Include a copy of your sales receipt as proof of purchase with your package.</strong></li>\r\n                                                            </ul>\r\n                                                            <h5 style="background: #000; color: #fff; float: left; font-size: 14px; margin: 12px 0 6px; padding: 1px 2px 2px;" class="txtBebas clear">Step #3</h5>\r\n                                                            <ul class="clear">\r\n                                                                <li><strong>Customers in the US:<br>\r\n                                                                    Send your package to the Zippo Repair Clinic insured and via a trackable method to: </strong>\r\n                                                        