ng>Package your writing instrument securely in an oversized box or padded shipping bag.</strong></li>\r\n                                                        <li><strong><a class="txtA7" style="text-decoration: underline;" href="/pdf/PJ14744-RepairForm_v1.pdf">Click here</a> for a convenient form to include with your package or enclose a note with your name, address, telephone number, and email address to receive a confirmation of receipt and reshipment of your repaired item. </strong></li>\r\n                                                        <li><strong>Include a copy of your sales receipt as proof of purchase with your package.</strong></li>\r\n                                                    </ul>\r\n                                                    <h5 style="background: #000; color: #fff; float: left; font-size: 14px; margin: 12px 0 6px; padding: 1px 2px 2px;" class="txtBebas clear">Step #2</h5>\r\n                                                    <ul class="clear">\r\n                                                        <li><strong>Customers in the US:<br>\r\n                                                            Send your package to the Zippo Repair Clinic insured and via a trackable method to: </strong>\r\n                                                            <span style="display: block;" class="txtRed txtBold">\r\n                                                                Zippo Repair Clinic<br>\r\n                                                                1932 Zippo Drive<br>\r\n                                                                Bradford, PA 16701<br>\r\n                                                            </span>\r\n                                                        </li>\r\n                                                        <li><strong>Customers in Europe:<br>\r\n                                                            Send your package to the Zippo Repair Clinic insured and via a trackable method to: </strong>\r\n                                                            <span style="display: block;" class="txtRed txtBold">\r\n                                                                Zippo European Repair Clinic<br>\r\n                                                                Groendahlscher Weg 87<br>\r\n                                                                D-46446 Emmerich am Rhein, Germany<br>\r\n                                                            </span>\r\n                                                        </li>\r\n                                                        <li><strong>Customers in other countries:<br>\r\n                                                            Send your package to the Zippo Repair Clinic insured and via a trackable method to the distributor or service center for your country. <a class="txtA7" style="text-decoration: underline;" href="/international.aspx">Click here</a> for listing.</strong>\r\n                                                        </li>\r\n                                                    </ul>\r\n                                                </div>\r\n                                                <!-- eo .pad -->\r\n                                            </div><!-- eo .repairLtSteps -->\r\n                                        </div>\r\n                                        <!-- eo #tabs-writing -->\r\n                                    </div>\r\n                                    <!-- eo #repairTabs -->\r\n                                </section><!-- eo #repairTabsHolder -->\r\n                            </div>\r\n                            <!-- eo .inner -->\r\n                        </section><!-- eo .wholeContent -->\r\n                    </div>\r\n                    <!-- eo .wholeInner -->\r\n                </div>\r\n                <!-- eo .wholeMain -->\r\n            </section>', '2014-09-20 13:58:59', '2014-09-20 13:58:59', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
