(20, 'Privacy Policy', 'one_column', NULL, NULL, 'privacy-policy', NULL, '<section class="wholePage acctAddress clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">Privacy &amp; Legal </h2>\r\n                        <nav class="leftInnerNav txtBebas">{{block type="cms/block" block_id="privacy-links"}}</nav>\r\n                        <section class="wholeContent">\r\n                            <div class="inner clearfix txtBold">\r\n                                <h3 class="hdrWholeCont txtRed txtBebas">\r\n                                    Privacy Policy</h3>\r\n                                <span style="font-weight:normal;">\r\n<br>\r\n1. <b> ZIPPO MANUFACTURNG COMPANY respects the privacy concerns of its customers and users of its Sites and has created this privacy statement to explain how we use and protect your personal information. We take reasonable efforts to protect any information you give us. </b><br>\r\n<br>\r\n2. <b>CALIFORNIA PRIVACY RIGHTS</b><br>\r\n<br>\r\n\r\nCalifornia residents who have a business relationship with ZIPPO may choose to opt-out of ZIPPO disclosing personal information to third parties for marketing purposes. ZIPPO may share any personal information you have given it with carefully screened companies that offer products or services that we believe you may enjoy. If you do not want us to share your personal information with such third parties, please send your name, address and phone number to calprivacy@zippo.com. <br>\r\n<br>\r\n3. <b>COLLECTION AND USE OF INFORMATION</b><br>\r\n<br>\r\nInformation is sometimes required for usage of the Sites, including purchase of an item or some service, or is requested from you for a particular use or purpose which we will inform you about at the time of use Your usage of the various Sites determines what information is collected. Any information that you do decide to give us will be used by us to improve your service and provide promotions and offers from ZIPPO, its subsidiaries, and promotional partners to you. <br>\r\n<br>\r\nIf you visit our Sites and wish to register, enter a contest or sweepstake, purchase products, obtain information regarding one of our products or services or request other information such as Consumer Relations assistance or otherwise communicate with us about our offerings, then we will request some personally identifiable information from you. <br>\r\n<br>\r\nPersonally identifiable information is any information relating to a natural person that can be used to identify them from that information by reference to an identification number or some other factor specific to identity. The personally identifiable information we collect about you on certain Sites can include your name, address, telephone number, cell phone number, birth date, email address, and financial information like your credit card number and expiration date. Information submitted, other than financial information, at the time of registration or during a submission may be used for marketing and promotional purposes by ZIPPO and its subsidiaries, and may be shared with our promotional partners. <br>\r\n<br>\r\nThe information is also used to get in touch with you when necessary regarding an order you have placed on a Site or to notify you if you have won a contest or sweepstake. <br>\r\n<br>\r\nFinancial information that is collected is used to process your request for products and services, and will not be shared with third parties who are not involved with the transaction. When credit card information is transmitted, we use industry standard, SSL (secure socket layer) encryption. Due to normal legal and auditing requirements, partial credit card information is retained by us in an encrypted form. That information is not shared with any partner or any person unnecessary for legal and auditing purposes. Please see below for more information. <br>\r\n<br>\r\nZIPPO may disclose your personally identifiable information in special situations when we have reason to believe this information is necessary to identify, contact, or bring legal action against someone who may be causing injury to or interference (either intentionally or unintentionally) with ZIPPO''s rights or property, other ZIPPO Site users, or anyone else that could be harmed by such activities. In addition, ZIPPO may use personally identifiable information to conduct other legitimate activities, such as protecting the security of its Sites and its networks, guarding against potential liability, engaging in debt collection, responding to a court order or subpoena, preventing fraud, complying with law, and complying with a legally permitted inquiry by a government agency or regulator. To the extent that any of our Sites have additional or different practices or policies, these practices will be explained on that Site. <br>\r\n<br>\r\nTo modify or delete the information you have provided during registration, please login and update your profile. You may always opt-out of receiving future mailings by clicking here. See the Choice/Opt-out section below. <br>\r\n<br>\r\n4. <b>SAFEGUARD YOUR USERNAME/PASSWORD</b>\r\nYou are responsible for any actions that take place while using your ZIPPO account. Keep your username/password secure and do not allow anyone else to use your username/password to access the Site. You agree to notify ZIPPO at consumerrelations@zippo.com or (888)-442-1932 immediately of any unauthorized use of your ZIPPO account. ZIPPO is not responsible for any loss that results from the unauthorized use of your username/password, with or without your knowledge. <br>\r\n<br>\r\n5. <b>SECURITY</b><br>\r\n<br>\r\n\r\nSecurity for all personally identifiable information is extremely important to us. Unfortunately, no data transmission over the Internet can be guaranteed to be 100% secure. As a result, while we strive to protect your personal information, ZIPPO cannot ensure or warrant the security of any information you transmit to us or is transmitted to you from our online products or services. All information is stored in a secure location behind a firewall with limited administrative access. However, you transmit information to us and receive information at your own risk. Once we receive your transmission, we make our best effort to ensure its security on our systems.<br>\r\n<br>\r\n6. <b>FOR PARENTS CONCERNING PRIVACY</b><br>\r\n<br>\r\n\r\nZippo complies with the Children''s Online Privacy Protection Act. See: <a href="http://www.ftc.gov" style="color: #df101d;">www.ftc.gov</a> <br>\r\n<br>\r\n7. <b>USE OF COOKIES AND PIXEL TAGS</b><br>\r\n<br>\r\nZIPPO receives and records information from your browser when you use any ZIPPO site and may use a variety of methods, such as “Cookies” and “Pixel Tags” to collect this information. A Cookie is a small removable data file that is stored by your web browser on you computer. Cookies allow you to place an order on our website and allow us to enhance and personalize your online experience. For example, we use Cookies to: <br>\r\n<br>\r\n\r\n<br>• Remember the items in your shopping cart \r\n<br>• Recognize you when you return to our website \r\n<br>• Store your username or login email and password to make it easer to login \r\n<br>• Confirm that users are logged in \r\n<br>• Enable you to use Express Checkout \r\n<br>• Analyze visitor behavior <br>\r\n<br>\r\nYou can choose to have your computer warn you each time a Cookie is being sent or you can choose to turn off all Cookies. If you turn all Cookies off, you won’t have access to many features that make your website experience more efficient and some of our services will not function properly. However, you can still place product orders over the telephone by contacting Consumer Relations number at 1-888-GGB-1932 (888-442-1932). We use Pixel Tags &ndash; tiny graphic images &ndash; to help us analyze your online behavior. Pixel Tags also allow us to send you email in a format you can read and let us know when you have opened an email message from us. We may use Pixel Tags to collect information about your visit, including the pages you view, the links you click and other actions taken in connection with our website. We also collect certain standard information that your browser sends to every Site you visit, such as your IP address, browser type and language, username, system type, whether you have enabling software to access certain website features, access times and referring website addresses. Other websites visited before visiting a Site might place personal information within the URL of your browser during a visit to that other website. ZIPPO may unintentionally collect that information as part of the referring website information we collect. <br>\r\n<br>\r\n8. <b> USE OF IP ADDRESSES</b><br>\r\n<br>\r\nAn IP address is a number that is automatically assigned to your computer by your internet provider whenever you are surfing the web. When you request pages from ZIPPO Sites, our servers log your IP address. ZIPPO collects IP addresses for the purposes of system administration, to report aggregate information to our partners, and to audit the use of our Site. Unless you purchase something we do not link IP addresses to anything personally identifiable, which means that your session will be logged, but you are anonymous to us. If you access the Buy feature in the online store, we will link your IP address to your credit card information as part of our fraud prevention program. We do this to protect you. We may use your IP addresses in cooperation with your internet provider to identify you if we feel it is necessary to enforce compliance with our Terms of Use or to protect our service, Sites, customers, or others. <br>\r\n<br>\r\n9. <b>MOBILE SERVICES</b><br>\r\n<br>\r\nThe Sites contains services and features that are available to certain mobile phones. Your carrier’s normal rates and fees apply. Not all mobile services will work with all carriers or devices. You should check the rates and services offered by your carrier. By using a mobile phone to access ZIPPO Sites, you agree that that certain information about your use of these services may be shared with us through third party partners. <br>\r\n<br>\r\n10. <b>CHOICE/OPT-OUT</b><br>\r\n<br>\r\n\r\nOur Sites may provide you the opportunity to opt-in to receive communications from us at the point where we request information about you. If you receive a communication and would like to opt-out and remove your name from any future communication, follow the specific instructions outlined within the communication you receive. However, if you are unable to complete the process indicated in the communication, send an email to consumerrelations@zippo.com with a copy of the email attached to the request and statement of your desire to be removed from the mailing list. Your opt-out request will be processed within 10 days of the date it is received.<br>\r\n<br> \r\n11. <b>LINKS TO OTHER SITES</b><br>\r\n<br>\r\n\r\nZIPPO is not responsible for the content or practices of third party websites that may be linked to our Sites. Our Sites may also be linked to websites operated by other companies. Visitors to these websites should refer to each website''s respective privacy policies and practices. <br>\r\n<br>\r\n12. <b>CONTACT US </b><br>\r\n<br>\r\nIf you have any questions about the Terms of Use, Terms of Service, Privacy Policy, the practices of our Sites or your dealings with our Sites, contact:<br>\r\n<br> \r\n<br>Zippo Customer Care \r\n<br>33 Barbour Street \r\n<br>Bradford PA, 16701 \r\n<br>Phone: (814) 368-2700 <a href="mailto:consumerrelations@zippo.com" style="color: #df101d;">consumerrelations@zippo.com</a><br>\r\n<br>Information provided by you via general email inquiries to ZIPPO, such as your email address, is used only to respond to your inquiries in the ordinary course of business, and is never shared with third parties. <br>\r\n<br>To view educational material on consumer privacy, please see <a href="http://www.ftc.gov" style="color: #df101d;">www.ftc.gov</a>\r\n\r\n                            </span></div>\r\n                            <!-- eo .inner -->\r\n                        </section><!-- eo .wholeContent -->\r\n                    </div>\r\n                    <!-- eo .wholeInner -->\r\n                </div>\r\n                <!-- eo .wholeMain -->\r\n            </section>', '2014-09-20 14:20:18', '2014-09-20 14:20:18', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(21, 'Terms & Conditions', 'one_column', NULL, NULL, 'terms-and-conditions', NULL, '<section class="wholePage acctAddress clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">Privacy &amp; Legal </h2>\r\n                        <nav class="leftInnerNav txtBebas">{{block type="cms/block" block_id="privacy-links"}}</nav>\r\n                        <section class="wholeContent">\r\n                            <div class="inner clearfix txtBold">\r\n                                <h3 class="hdrWholeCont txtRed txtBebas">\r\n                                    Terms &amp; Conditions</h3>\r\n                                <h3>ZIPPO MANUFACTURING COMPANY GENERAL TERMS OF USAGE</h3> <span style="font-weight:normal;">\r\n \r\n<br>\r\n<h4>IMPORTANT! PLEASE READ CAREFULLY</h4>\r\n<br>\r\nThese General Terms of Usage, including the Privacy Policy, Copyright Notice, Trademark Statement, Request For Reproduction Permissions, and General Terms of Service (located below), together hereafter the “Terms”, constitute a legal agreement between you and Zippo Manufacturing Company (hereafter ZIPPO) and spell out the terms and conditions to which users of ZIPPO websites are required to adhere. The ZIPPO sites include: Zippo.com; ZippoRetailer.com, ZippoEncore.com, RonsonCorpUSA.com, and any other site in which these Terms appear (collectively, referred to herein as “ZIPPO sites”, “Sites”, “we” or “us”). It does not apply to affiliated websites, products, or services.<br>\r\n<br>\r\nThe Sites are operated by ZIPPO in whole or in part, from the United States by it and its subsidiaries and affiliates. By accessing or using the Sites, services, or the mobile versions of any Site, you signify that you have read, understand and agree to be bound by these Terms and any other applicable law, whether or not you are a registered user of ZIPPO. ZIPPO may change these Terms at any time without notice, effective upon its posting to this website. You agree to review these Terms regularly to make yourself aware of any changes. Your continued use of the websites shall be considered your acceptance to the revised Terms. If you do not agree to these Terms, please do not use this website.<br>\r\n<br>\r\nBy using a Site, you agree to be bound by the terms set forth herein and any supplemental terms of the applicable Site, all of which are hereby incorporated by reference into these Terms of Usage (Terms). If you do not agree with or do not wish to be bound by all of the Terms, do not use any of the Sites. We reserve the right to amend these Terms at any time. Amended Terms will be posted on this website. Your continued use of any Site following the posting of changes to these Terms means you accept the changes.<br>\r\n<br>\r\n<h4><u>INTERNATIONAL USERS</u></h4>\r\n<br>\r\nThis website is operated, in whole or in part, from the United States By using any of ZIPPO websites, regardless of where you live in the world, you consent to have any personal data you submit to any Site transferred to and processed in the United States. ZIPPO does not collect or use personally identifiable information from persons located outside the United States. ZIPPO does not ship products to consumers located in any foreign country. ZIPPO reserves the right to refuse shipment of any product for any reason or no reason.<br>\r\n<br>\r\n<a style="color: #df101d;" href="http://www.zippo.com/privacy.aspx"><u>PRIVACY POLICY</u></a> <br>\r\n<br>\r\nZIPPO respects the privacy concerns of its customers and users of its Sites and has created this privacy statement to explain how we use and protect your personal information. We take reasonable efforts to protect any information you give us. Open link to view. The Privacy Policy is incorporated here by reference.<br>\r\n<br>\r\n<h4>CONTENTS:</h4>\r\n<br>\r\n\r\n<br>1. ZIPPO SITES CONTENT AND USER SUBMISSIONS \r\n<br>2. USER GENERATED CONTENT, PRODUCT REVIEWS AND DISCUSSIONS \r\n<br>3. TERMS FOR THE ONLINE STORE \r\n<br>4. PERSONALIZED LIGHTERS - DEZIGN MINE PRODUCT CUSTOMIZATION &ndash; USA CONSUMERS ONLY \r\n<br>5. ACCESS AND AVAILABILITY OF SERVICES AND LINKS \r\n<br>6. LIMITATION OF LIABILITY \r\n<br>7. SYSTEM INTEGRITY \r\n<br>8. TERMINATION OF USE\r\n<br>9. LEGAL STATEMENT \r\n<br>10. COPYRIGHT NOTICE \r\n<br>11. TRADEMARK NOTICE<br>\r\n<br>\r\n<h4>1.<u> ZIPPO SITES CONTENT AND USER SUBMISSIONS</u> </h4><br>\r\n<br>\r\n1.1 The contents of the ZIPPO Sites are intended for the personal use of its users. All materials published on the Sites (including, but not limited to information, articles, photographs, images, illustrations, product descriptions, audio clips and video clips (collectively, the "Content") are protected by copyright, trademark and all other applicable intellectual property laws, and are owned or controlled by ZIPPO or the party credited as the provider of such Content, software or other materials. You must abide by copyright or other notices, information and restrictions appearing in conjunction with any Content accessed through the Sites.<br>\r\n<br> \r\n1.2. The Sites are protected by copyright as a collective work and/or compilation, pursuant to U.S. copyright laws, international conventions and other copyright laws. Except as may otherwise be set forth in Section 1 of these Terms of Service, you may not modify, adapt, translate, exhibit, publish, transmit, participate in the transfer or sale of, create derivative works from, distribute, perform, display, reverse engineer, decompile or dissemble, or in any way exploit, any of the Content, software, materials of any Site in whole or in part. <br>\r\n<br>\r\n1.3 Copying or storing of any Content for other than personal, noncommercial use is expressly prohibited without the prior written permission from ZIPPO, or the copyright holder identified in the individual Content''s proprietary rights notices. For the avoidance of doubt, including any Content (in whole or in part) on your personal website, when it is accessible to any other person, is not a personal use and is not permitted. <br>\r\n<br>\r\n1.4 By using any Site you agree that any information, feedback, questions, comments and/or submissions to us, the Sites, (as discussed below) or the like (not including “Personal Information” discussed above in the Privacy Policy) that you provide to us in connection with any Site ("Submission") will be deemed to be provided to us on a non-confidential and non-proprietary basis and will become and remain our property. We shall have no obligation of any kind with respect to any Submission and shall be free to reproduce, use, disclose and/or distribute any Submission for any purpose whatsoever, without limitation. You also agree that we shall be free to use any ideas, concepts or techniques embodied in the Submission for any purpose whatsoever, including, but not limited to, developing, manufacturing, and marketing products or services incorporating such ideas, concepts, or techniques. In addition, you hereby waive all ownership or moral rights you may have in any materials uploaded or sent to us by you.<br>\r\n<br> \r\n1.5 To enable ZIPPO to use the information you supply to us, and so that we are not violating any rights you might have in that information, you agree to grant us a non-exclusive, worldwide, perpetual, irrevocable, royalty-free, sub-licensable (through multiple tiers) right to exercise the copyright, publicity and database rights you have in your information, in any media now known or not currently known, with respect to your information. ZIPPO will only use your information in accordance with our Privacy Policy. <br>\r\n<br>\r\n1.6 If you believe that the content of any Submission provided by you, or any Content appearing on a Site, has been used on a Site in a manner that constitutes copyright infringement, please provide our General Counsel with a written notice (email is sufficient) that includes the following information: an electronic or physical signature of a person authorized to act on behalf of the owner of the exclusive right that is allegedly infringed; identification of the copyrighted work claimed to have been infringed; a description of where the material that you claim is infringing is located on the Site; your address, telephone number, and email address; a statement by you that you have a good faith belief that the disputed use is not authorized by the copyright owner, its agent, or the law; and a statement by you, under penalty of perjury, that the information in your notice is accurate and that you are the copyright owner or authorized to act on the copyright owner''s behalf. The email address is <a style="color: #df101d;" href="mailto:generalcounsel@zippo.com">generalcounsel@zippo.com</a> <br>\r\n<br>\r\nOur Copyright Agent for notice of claims of copyright infringement on this Site is: <br>\r\n<br>\r\nZippo Manufacturing Company Attention: General Counsel 33 Barbour Street Bradford, PA 16701 Fax (814) 363-2597 Telephone: (814) 368-2700 <a style="color: #df101d;" href="mailto:generalcounsel@zippo.com">generalcounsel@zippo.com</a><br>\r\n<br>\r\n<h4>2 .<u>USER GENERATED CONTENT, PRODUCT REVIEWS AND DISCUSSIONS</u> </h4><br>\r\n<br>\r\n2.1 The Sites may make available product reviews and surveys. You shall not upload to, or distribute or otherwise publish in those sections through any content which is libelous, defamatory, obscene, pornographic, profane, sexually explicit, abusive or which otherwise violates any law, rule or regulation. Please use good judgment and be respectful of other individuals using the product reviews and surveys. You agree not to use vulgar, abusive or hateful language. Product reviews and surveys within the Site are provided to give our users interesting and helpful information in which they may express opinions and share ideas concerning ZIPPO products and related matters. ZIPPO does not endorse the opinions placed in these product reviews and surveys. <br>\r\n<br>\r\n2.2 The product reviews shall be used by you only in a noncommercial manner. You shall not, without the express approval of ZIPPO, use the product reviews to distribute or otherwise publish any material containing any solicitation of funds, advertising or solicitation for goods or services or to promote websites or online services that are competitive with ZIPPO and the Service. <br>\r\n<br>\r\n2.3 While we do not and cannot review every message posted by users in the Product Reviews and are not responsible for the content of any of these messages, ZIPPO reserves the right to delete, move or edit messages that we, in our sole discretion, deem are in violation of the law (including trademark and copyright law), or these Terms of Service, or are abusive, defamatory, obscene or otherwise unacceptable. You shall remain solely responsible for the content of your messages. ZIPPO reserves the right to revoke a user’s Site privileges and access at any time for any reason or no reason. <br>\r\n<br>\r\n<h4><u>General Rules for User-Generated Content </u></h4><br>\r\n<br> \r\n\r\n2.4 Guests of ZIPPO Sites are solely responsible for the content of messages they post in any Forum, blog, social media site or consumer review. Users should be aware that when they voluntarily disclose personal information (e.g., user name, email address, phone number) in the previously mentioned content pages and any social network pages where ZIPPO hosts a page or space like Facebook, Twitter, etc, that information can be collected and used by others for any reason. <br>\r\n<br>\r\n<h4>2.5 <u>Content is Not Prescreened</u></h4><br>\r\n<br>\r\n\r\nZIPPO does not guarantee to prescreen User Generated Content. ZIPPO does not guarantee the website will be free from User Generated Content that is inaccurate, deceptive, offensive, threatening, defamatory, unlawful or otherwise objectionable. ZIPPO is merely acting as a passive channel for such distribution and is not undertaking any obligation or liability relating to any User Generated Content or activities of users on the website. Even in the event ZIPPO chooses to monitor any User Generated Content, ZIPPO assumes no responsibility for, or any obligation to monitor or remove, such User Generated Content. ZIPPO reserves the right to edit, remove, or refuse to post any User Generated Content or terminate your registered account for any reason. <br>\r\n<br>\r\n<h4>2.6 <u>Eligibility and Registration</u></h4><br>\r\n<br>\r\n\r\nTo post User Generated Content like product reviews and to customize your own product in the online store pages, you must register for an account. You agree to provide accurate and current information about yourself in all registration forms on the website. This website is intended solely for users who are eighteen (18) years of age or older and it is a violation of these Terms of Use for anyone under 18 to register for the website. You represent and warrant that you are 18 or older. Your account may be deleted without warning if you misrepresent your age, whether older or younger. <br>\r\n<br>\r\n<h4>2.7 <u>ZIPPO''s Rights to Your Posting</u></h4><br>\r\n<br>\r\n\r\nYour User Generated Content is not confidential or proprietary. You grant, and warrant that you have the right to grant, to ZIPPO a non-exclusive, non-revocable, worldwide, transferable, royalty-free, perpetual right to use your User Generated Content in any manner or media now or later developed, for any purpose, commercial, advertising, or otherwise, including the right to translate, display, reproduce, change, create derivative works, sublicense, distribute, assign and commercialize without any payment due to you. <br>\r\n<br>\r\n<h4>3.<u>TERMS FOR THE ONLINE STORE</u> </h4><br>\r\n<br>\r\n3.1 In addition to the provisions contained in these Terms, the following terms apply specifically to the online store, currently located at <a style="color: #df101d;" href="http://www.zippo.com">www.Zippo.com</a><br>\r\n<br>\r\n\r\n<br>•By placing an order, you certify that you are able to pay for the item(s) in your order.<br>\r\n<br>\r\n\r\n<br>•By placing an order on Zippo.com (or any other online store operated by ZIPPO, hereafter referred to as “Zippo.com”) you agree    to be bound by the conditions of sale included in the item''s description (including, without limitation, payment method and  acceptable ship-to address). <br>\r\n<br>\r\n\r\n<br>•If you place an order for flame products on Zippo.com you are certifying that you are at least 18 years old or the applicable age    of majority in the jurisdiction in which you reside and have the legal right to purchase such item. <br>\r\n<br>\r\n\r\n<br>•You shall comply with all applicable domestic and international laws, statutes, ordinances and regulations regarding your use    of the online store and your purchase of items. <br>\r\n<br>\r\n<br>•You are responsible for the accuracy of any purchase placed online.<br>\r\n<br>\r\n\r\n<br>•We may reject your order at our discretion and reserve the right to cancel any order or refuse service to anyone at any time. If    we cancel your order after we have charged you for your order, we will refund your credit card the amount charged as soon as practical. <br>\r\n<br>\r\n\r\n<br>•Due to Hazardous Goods regulations, we may not be able to ship certain merchandise to your address. For instance, we can    only ship Multi-Purpose Lighters and other hazardous products by ground and therefore we can’t ship to Hawaii, other islands or Alaska. ZIPPO reserves the right to refuse shipment of any product for any reason or no reason. <br>\r\n<br>\r\n\r\n<br>•ZIPPO does not ship products to any consumer in any foreign country. <br>\r\n<br>\r\n\r\n<br>•We reserve the right to add and/or remove products on Zippo.com, for any reason, at any time. <br>\r\n<br>\r\n\r\n<br>•We reserve the right to limit quantities of items sold. <br>\r\n<br>\r\n\r\n<br>•You may not transfer or sell your User ID or account to another party. <br>\r\n<br>\r\n\r\n<br>•Unless otherwise stated, all prices are quoted in U.S. Dollars.<br>\r\n<br> \r\nProducts available from any Site may be advertised on third party shopping websites. ZIPPO is not responsible for any information on such shopping websites, or for any differences which may exist between information found on such third party sites and information on any Site, including, but not limited to pricing information. In the event that a difference exists, information found the Site shall govern. <br>\r\n<br>\r\nAll purchases from any Site are made pursuant to a shipment contract. This means that the risk of loss and title for such items pass to you upon our delivery of the items to the carrier. <br>\r\n<br>\r\n<h4>4. <u>PERSONALIZED LIGHTERS - PRODUCT CUSTOMIZATION &ndash; USA CONSUMERS ONLY </u></h4><br>\r\n<br>\r\na) These are ZIPPO’s guidelines for a personal photo or artwork (hereafter “artwork”) intended to be placed on a Zippo lighter or other product. Consumers that submit artwork for use by ZIPPO to create a customized product (products may include lighters, hand warmers, candle lighters, etc.) are responsible for making sure the proposed artwork complies with these Guidelines AND all applicable law. Prior to accepting an order, users will be required to confirm the photo or art is their intellectual property to use. ZIPPO does not knowingly accept any artwork that infringes another person’s intellectual property rights. If you believe that artwork on a ZIPPO lighter infringes your intellectual property rights or those rights of another person or entity, please email us at: <a style="color: #df101d;" href="mailto:generalcounsel@zippo.com">generalcounsel@zippo.com</a><br>\r\n<br>\r\n<br>\r\nb) <u>QUESTIONABLE MATERIAL &amp; PROHIBITED ARTWORK</u><br>\r\n<br>\r\n\r\nThe consumer takes full responsibility for any photo or artwork presented to ZIPPO. ZIPPO reserves the right to review it to determine if, to the extent it is possible to do so, the artwork can be used without violation of some other person’s intellectual property rights or applicable law. However, the fact that we accept the artwork does not mean ZIPPO or any other person or entity excuses you from your obligation.<br>\r\n<br> \r\nPhotos or artwork that appears to be acceptable for use will be accepted. Content that appears to be not acceptable will be rejected, subject to the consumer providing proof of right to use. <br>\r\n<br>\r\nc) <u>GENERAL GUIDELINES FOR PHOTOS OR ARTWORK</u><br>\r\n<br>\r\n\r\nBelow are some general types of photos or artwork (hereafter “artwork”) that are not acceptable for decoration of ZIPPO products: Whether artwork is acceptable for decoration on a ZIPPO lighter or other product is determined solely by ZIPPO. Summary of artwork that will not be acceptable: <br>\r\n<br>\r\n\r\n<br>•Artwork that may infringe the copyright of a third party<br>\r\n<br>\r\n\r\n<br>•Artwork that may infringe the trademark of a third party<br>\r\n<br>\r\n\r\n<br>•Artwork that infringes the Right of Publicity of a third party<br>\r\n<br>\r\n\r\n<br>•Names, logos, pictures, or other intellectual property of musical groups or musical artists<br>\r\n<br>\r\n\r\n<br>•Sports teams names, logos or other intellectual property of colleges/universities, clubs, or organizations, such as New York Yankees, Real Madrid, Notre Dame, or a non-profit organization &ndash; e.g. the Red Cross<br>\r\n<br>\r\n\r\n<br>•Trademarks, names, or logos of companies. For example, you cannot use the name of a company such as ZIPPO or a company logo such as the ZIPPO logo<br>\r\n<br>\r\n\r\n<br>•Copying of an existing piece of artwork, cartoon, photograph or video frame. Changing a piece of artwork by rearranging the    elements of the artwork is not acceptable<br>\r\n<br>\r\n\r\n<br>• Photos, logos, caricatures, or other artwork depicting celebrities or other third parties. Just because you take a photograph does not give you the right to use that photograph on merchandise, even if you digitally manipulate the photograph<br>\r\n<br>\r\n\r\n<br>•Inappropriate content or nudity<br>\r\n<br>\r\n\r\n<br>•Artwork that exploits minors<br>\r\n<br>\r\n\r\n<br>•Artwork that is obscene or vulgar, contains offensive remarks or harasses, threatens, defames or abuses others, or is racist or Nazi<br>\r\n<br>\r\n\r\n<br>•Artwork that depicts violence, is obscene, abusive, fraudulent or threatening<br>\r\n<br>\r\n\r\n<br>•Artwork that glamorizes drug use or alcohol abuse; or<br>\r\n<br>\r\n\r\n<br>•Material that is generally offensive or in bad taste, as determined by ZIPPO in its sole discretion<br>\r\n<br>\r\n\r\n\r\nThe list is not exhaustive. It is only a general guideline for you to consider when you submit artwork to ZIPPO.<br>\r\n<br>\r\n\r\n\r\nIf your artwork is deemed by ZIPPO to be unacceptable, a refund of the purchase price will be made as a credit to the credit card you used to make the purchase. <br>\r\n<br>\r\nd) <u>FREQUENTLY ASKED QUESTIONS </u><br>\r\n<br>\r\n<br>\r\n\r\n<b>Does ZIPPO own the rights to my artwork?</b><br>\r\n<br> \r\nIf you submit artwork to be placed on lighters that you intend keep or gift to someone else, you retain all rights to your artwork but do grant a limited, non-exclusive license to ZIPPO to allow ZIPPO to place your artwork on its lighters or other product and ship your products to you. <br>\r\n<br>\r\n<b>If it does not have a copyright notice, is it ok to use?</b><br>\r\n<br>\r\nAlmost all works are protected by copyright, even if they do not have a copyright notice. Therefore, you need to obtain written permission to use any artwork that you did not create.<br>\r\n<br>\r\n<b>Is it ok to use an image I found on the internet? </b><br>\r\n<br>\r\nNo. Simply because an image (artwork, photograph, etc.) is on the internet does not mean that it is in the public domain or available for your use. You cannot use the work unless the author of the work has explicitly granted you a license to use the work or it is in the public domain. Further, a person who posts an image on the internet and claims that you are free to use it may not have had the right to post the image in the first place. Thus, your use of the image may violate the rights of the actual copyright owner or a person’s right of publicity or right of privacy.<br>\r\n<br>\r\n<b>If I took a photograph of a celebrity or a company logo can I use it to make merchandise? </b><br>\r\n<br>\r\nNo. Taking a photo of a person, company building, product, brand, or logo does not give you the right to sell merchandise featuring that photograph. There are two distinct intellectual property rights in a photograph: (1) the rights in the photograph itself and (2) the rights in the subject of the photograph, such as the product or person shown in it. In order to order merchandise with the photograph, you will need to obtain explicit permission from the celebrity. <br>\r\n<br>\r\n<b>I based my artwork on the artwork of a third party, is that ok?</b> <br>\r\n<br>\r\nNot generally speaking. It depends on what you mean by “based it on.” Artwork derived from the previous work of another will likely violate the rights of the owner of the previous artwork. If you are creating a design that is based on the work of someone else, you will probably need to obtain permission from the owner of the original artwork prior to using it. If the other artwork just inspired you to create a new piece of artwork that is truly new artwork then you should not be violating the copyright of the other person. However, you should consult with an attorney before using any artwork based on the artwork of another person. <br>\r\n<br>\r\n<b>Is parody ok?</b><br>\r\n<br>\r\nMaybe. ZIPPO generally does not accept parody artwork and will not automatically accept such artwork for use on its lighters or other products. Often we require you to obtain an opinion from your attorney that such use is legally acceptable. <br>\r\n<br>\r\n<b>I am using Clip Art, is it ok?</b><br>\r\n<br>\r\nNo. Most clip art, photo collections, or graphic programs contain a license agreement. The license agreement sets forth the specific permissible uses for the clip art. In most instances the license does not grant you the right to use the clip art commercially, for the sale of merchandise. You should consult the clip art license agreement and your attorney to determine whether you can use the images. <br>\r\n<br>\r\ne. <b><u>RETURNS</u></b> <br>\r\n<br>\r\nZIPPO inspects all personalized product ordered on any Site for manufacturing errors or product defects. If you believe there is a quality issue with your product, you may return it in as-new condition and in its original packaging for a prompt exchange for the same item, or immediate full refund of the product purchase price. Understandably, personalized products cannot be accepted for return unless there is a manufacturing error or product defect. All refunds or exchanges must be made within 30 days of receipt. <br>\r\n<br>\r\nZIPPO wants your personalized order to arrive just the way it was ordered by you. Please review your personalization information carefully before submitting your order. ZIPPO will not accept cancellations or changes to orders once they are placed as they are immediately sent to production.\r\nIf you have purchased ZIPPO products from another online retailer or store, please contact that retailer directly for instructions. <br>\r\n<br>\r\n5.<u> ACCESS AND AVAILABILITY OF SERVICES AND LINKS </u><br>\r\n<br>\r\n5.1 A Site may contain links to other internet sites. Your selection of a link will redirect you off of the ZIPPO Site to a third party website. Interactions that occur between you and the third party website are strictly between you and such third party website and are not the responsibility of ZIPPO. We are not responsible for examining or evaluating, and do not warrant the offerings of, any of these linked sites. ZIPPO does not assume any liability or responsibility for the actions, product, availability or content of these outside websites. You should direct any concerns regarding any externally linked website to the administrator or webmaster of the third party website. <br>\r\n<br>\r\n6. <u>LIMITATION OF LIABILITY </u><br>\r\n<br>\r\n6.1 NEITHER ZIPPO NOR ANY OTHER PARTY INVOLVED IN CREATING, PRODUCING OR DELIVERING THE SITES SHALL BE RESPONSIBLE TO YOU OR ANY THIRD PARTIES FOR ANY DIRECT OR INDIRECT, CONSEQUENTIAL, SPECIAL, PUNITIVE OR EXEMPLARY DAMAGE OR LOSS INCURRED IN CONNECTION WITH USE OF, OR INABILITY TO USE, ANY OF THE SITES, OR ANY OF THE MATERIALS PROVIDED BY ZIPPO OR THIRD PARTIES THROUGH ANY OF THE SITES OR THE SERVICES THEREON, OR ANY DAMAGE OR LOSS INTERRUPTION OF USE, DELETIONS OF FILES, ERRORS OR DEFECTS IN THE USERS SYSTEM, REGARDLESS OF THE CLAIM AS TO THE NATURE OF THE CAUSE OF ACTION, EVEN IF ZIPPO HAS BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGE OR LOSS. SOME JURISDICTIONS MAY NOT ALLOW THE EXCLUSION OR LIMITATION OF INCIDENTAL OR CONSEQUENTIAL DAMAGES, SO THE ABOVE EXCLUSIONS SHALL ONLY APPLY TO THE EXTENT PERMISSIBLE UNDER APPLICABLE LAW. <br>\r\n<br>\r\n6.2 To the fullest extent permissible under applicable law, Zippo Manufacturing Company aggregate liability, and the aggregate liability of our subsidiaries, affiliates and officers, to you or any third party is limited to One Thousand U.S. Dollars ($1000). <br>\r\n<br>\r\n7. <u>SYSTEM INTEGRITY </u><br>\r\n<br>\r\nYou may not use any device, software, virus or routine to interfere or attempt to interfere with the proper working of any Site or any transaction conducted on such Site. You may not take any action which imposes an unreasonable or disproportionately large load on our infrastructure relative to your use, which is non-commercial. You may not disclose or share your password with any third parties or use your password for any unauthorized service. <br>\r\n<br>\r\n8. <u> TERMINATION OF USE </u><br>\r\n<br>\r\n8.1 ZIPPO may, in its sole discretion, terminate or suspend your access or refuse access at any time, without notice, to all or part of any of the Sites for any or no reason, including, without limitation, breach of these Terms or the infringement of copyrights owned by third parties. <br>\r\n<br>\r\n8.2 ZIPPO, including, without limitation, its authorized agents and employees may terminate your use of any of the Sites without notice in the event that you breach any obligation in these Terms of Service, including but not limited to, (i) restricting, inhibiting or disrupting any ZIPPO event or (ii) attempting to alter or improperly access any feature or function of any of the Sites. Your access may also be subject to termination if you post or transmit any illegal content; harass or threaten any user of any Site or any ZIPPO employee; post content (including, but not limited to, the creation of a username) that is offensive or otherwise disruptive of Site activities; post unsolicited advertising; or improperly impersonate a ZIPPO employee or other individual. <br>\r\n<br>\r\n9. <u>LEGAL STATEMENT </u><br>\r\n<br>\r\n9.1 These Terms have been made in and shall be construed and enforced in accordance with Pennsylvania and Federal law without regard to any conflict of law provisions. ZIPPO makes no representation that the Content on the Sites is appropriate for access outside of the United States. Those who choose to access the Sites from outside the United States do so on their own initiative and are responsible for compliance with local laws. You agree that any action to enforce this Agreement shall be brought in the federal or state courts located in McKean County, Pennsylvania or the Federal Courts of the Western District of Pennsylvania. <br>\r\n<br>\r\n9.2 Official correspondence must be sent via postal mail or express service to: <br>\r\n<br>\r\n\r\n<br>Zippo Manufacturing Company \r\n<br>Attention: General Counsel \r\n<br>33 Barbour Street \r\n<br>Bradford, PA 16701<br>\r\n<br> \r\n9.3 The Terms of Service, the Terms of Use, the Privacy Statement and any other terms referenced herein (hereafter “Terms”) constitute the entire agreement between you and ZIPPO with respect to your access and use of the Sites and supersede all prior or contemporaneous agreements (whether oral, written or electronic) between you and ZIPPO with respect to the Sites. If any of the provisions of these Terms are determined to be invalid or unenforceable, then each invalid or enforceable provision will be construed in a manner consistent with applicable laws to reflect, as nearly as possible, the original intentions of the parties and the remaining provisions shall remain in full force and effect. ZIPPO may assign these Terms (i) to any of its affiliates; (ii) to the surviving entity in the event of a merger, acquisition, or the sale of all or substantially all of the assets of ZIPPO; or (iii) in connection with the sale of any of the Sites or the business unit associated with the Sites. <br>\r\n<br> \r\n10. <u>COPYRIGHT NOTICE </u><br>\r\n<br>\r\nCopyright &copy; 2011 Zippo Manufacturing Company, All rights reserved. The material on the Sites may not be reproduced and may not be distributed, publicly performed or otherwise used in any manner, except with the prior express written permission of Zippo Manufacturing Company. <br>\r\n<br> \r\n11. <u>TRADEMARK STATEMENT </u><br>\r\n<br>\r\n\r\n<img height="35" src="/images/editorials/1_1573_AV_Logo1.jpg?953">, “ZIPPO”, “ <img height="14" src="/images/editorials/1_1573_AV_Logo3.jpg\r\n"> ” , “\r\n <img height="14" src="/images/editorials/1_1573_AV_BLU%20Logo.jpg?96"> ” , "SLIM", "MPL", "OUL",\r\n<img height="14" src="/images/editorials/1_1573_AV_Armor%20Logo.jpg?705"> , \r\nVenetian,\r\n<img height="35" src="/images/editorials/1_1573_AV_Logo2.jpg?860">, <img height="40" src="/images/editorials/1_1573_AV_Windy%20Logo.jpg?359">, \r\n “Black Ice” , <img height="20" src="/images/editorials/1_1573_PREVIEW.jpg?659">   and “BLU" are registered trademarks in the United States and in many countries. The listed Trademarks are used in the United States under license of ZippMark, Inc. The Multi Purpose Lighter shape, the BLU Lighter shape <img height="30" src="/images/editorials/1_1573_AV_Logo4.jpg">  and the BLU Z Windscreen are patented designs in the U.S.A. and are registered designs in many countries. \r\nAll Zippo lighter decorations are protected by copyright. Zippo Manufacturing Company. All Rights reserved. 2013.\r\n\r\n\r\n\r\n<br>\r\n<br>\r\nNo material found or located on the ZIPPO Sites may be, downloaded, framed, linked to, copied, reproduced or used in any other way in any media now existing or hereafter created without the prior written permission of ZIPPO. You may write or fax the General Counsel of Zippo Manufacturing Company to seek permission at this address: <br>\r\n<br>\r\n<br>Zippo Manufacturing Company. \r\n<br>Attention: General Counsel \r\n<br>33 Barbour Street \r\n<br>Bradford, PA 16701 \r\n<br>Fax #: 814 363-2597<br>\r\n<br>\r\n\r\n&copy; 2013 Zippo Manufacturing Company. All rights reserved. \r\n\r\n\r\n\r\n\r\n                            </span></div>\r\n                            <!-- eo .inner -->\r\n                        </section><!-- eo .wholeContent -->\r\n                    </div>\r\n                    <!-- eo .wholeInner -->\r\n                </div>\r\n                <!-- eo .wholeMain -->\r\n            </section>', '2014-09-20 14:30:32', '2014-09-20 14:30:32', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
