(22, 'Brand Protection', 'one_column', NULL, NULL, 'brand-protection', NULL, '<section class="wholePage acctAddress clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">Privacy &amp; Legal </h2>\r\n                        <nav class="leftInnerNav txtBebas">{{block type="cms/block" block_id="privacy-links"}}</nav>\r\n                        <section class="wholeContent">\r\n                            <div class="inner clearfix txtBold">\r\n                                <h3 class="hdrWholeCont txtRed txtBebas">\r\n                                    Brand Protection</h3>\r\n                                <span style="font-weight:normal">                                                     \r\n\r\nThe Zippo brand dates back to 1932 when the first Zippo lighter was built. Today, the brand enjoys a very high unaided awareness rate worldwide.  \r\nZippo has invested significantly to promote its high-quality products and build a globally recognized brand. Zippo is aggressively protecting its trademark by asserting its legal rights to stop the manufacturing of infringing lighters. <br>\r\n<br>\r\nAuthentic Zippo lighters are available on <a style="color: #df101d;" href="http://www.zippo.com">Zippo.com</a>\r\n, Zippo/Case Museum store, and through authorized Zippo retailers in more than 160 countries around the world.  Infringing lighters have misled consumers over the years. Many counterfeit lighters look a great deal like a real Zippo lighter. Zippo enthusiasts know that authentic Zippo lighters carry the Zippo bottom stamp and the Zippo trademark stamped on the lighter insert. The famous Zippo Lifetime Guarantee also accompanies every genuine Zippo lighter. If you spot a fake Zippo lighter, please contact us immediately.<br>\r\n<br>\r\nZippo does not permit unauthorized alterations to genuine Zippo brand lighters and other products by, among other things, the application of artwork, emblems, or other alterations constitutes a serious violation of Zippo’s intellectual property rights which it will enforce in the courts.  Regardless of the quality of the alterations, sale of the altered product under the Zippo name is an infringement of Zippo’s trademarks. The world famous ZIPPO trademark is registered on the Principal Register in the United States and in almost every country on Earth. <br>\r\n<br>\r\nFor additional information about counterfeiting, visit the following sites:<br>\r\n\r\n<br>  • <a style="color: #df101d;" href="http://www.uspto.gov"> United States Patent and Trademark Office</a>\r\n<br>  •<a style="color: #df101d;" href="http://www.stopfakes.gov"> Stop Fakes</a>\r\n<br>  •<a style="color: #df101d;" href="http://www.uschamber.com"> United States Chamber of Commerce</a>\r\n\r\n                            </span></div>\r\n                            <!-- eo .inner -->\r\n                        </section><!-- eo .wholeContent -->\r\n                    </div>\r\n                    <!-- eo .wholeInner -->\r\n                </div>\r\n                <!-- eo .wholeMain -->\r\n            </section>', '2014-09-20 14:59:54', '2014-09-20 14:59:54', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(23, 'Auction Website Sales', 'one_column', NULL, NULL, 'acution-website-sales', NULL, '<section class="wholePage acctAddress clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">Privacy &amp; Legal </h2>\r\n                        <nav class="leftInnerNav txtBebas">{{block type="cms/block" block_id="privacy-links"}}</nav>\r\n                        <section class="wholeContent">\r\n                            <div class="inner clearfix txtBold">\r\n                                <h3 class="hdrWholeCont txtRed txtBebas">\r\n                                    Auction Website Sales</h3>\r\n                                <span style="font-weight:normal">\r\n<h2>United States</h2>   \r\n<br>\r\n<h3>Zippo Manufacturing Company policies for sales on auction websites</h3>\r\n<br>\r\n\r\n\r\nZippo Manufacturing Company (ZMC) regularly polices internet auction sites concerning the sales of its products and has the legal authority to halt certain sales of products within the United States and several other countries under any of the following three circumstances:<br>\r\n<br>\r\n\r\n1.SALES OF COUNTERFEIT PRODUCTS; OR THE SALE OF PRODUCTS NOT ORIGINATING FROM ZMC UNDER THE NAME “ZIPPO” OR ANOTHER OF THE TRADEMARKS HELD BY ZMC, OR THE USE OF A NAME OR A TRADEMARK THAT IS CONFUSINGLY SIMILAR TO ZIPPO;<br>\r\n<br>\r\n\r\n2. SALES OF LIGHTERS FROM THIRD-PARTY MANUFACTURERS THAT HAVE THE REGISTERED SHAPE OF THE ZIPPO WINDPROOF LIGHTER; OR<br>\r\n<br>\r\n\r\n3.SALES OF ZIPPO LIGHTERS THAT HAVE BEEN DECORATED WITHOUT THE WRITTEN CONSENT OF ZMC;<br>\r\n<br>\r\n\r\nEach of the foregoing actions by a seller for commercial purposes constitutes a trademark infringement under U.S. law and the law in many countries and may lead to action being undertaken in defense of its legal rights by ZMC.<br>\r\n<br>\r\n\r\nAny of the above infringements are likely to cause consumers to be deceived into believing that such products are authorized, approved, or in some other way associated with Zippo Manufacturing Company. As many customers of Zippo products are collectors, ZMC must also enforce its rights under the trademark laws in protection of these consumer/collectors who have a legitimate interest that the products which they have purchased are genuine Zippo products, also as to the shape and decoration.<br>\r\n<br>\r\n\r\nFurther explanation of each of the above three grounds for legal action are set forth below.<br>\r\n<br>\r\n<h3>I.THE COMPANY AND ITS TRADEMARK RIGHTS</h3>\r\n<br>\r\nZMC, the manufacturer of the world famous lighters which are sold under the trademark ZIPPO, has numerous Trademark Registrations for the trademark ZIPPO.<br>\r\n<br>\r\n\r\nZMC also regards the highly distinctive shape of its windproof lighter with its characteristic arcuate (bowed) top as a trademark and has obtained protection of it through trademark registration in the USA and in many other countries.<br>\r\n<br>\r\n\r\nZMC was founded in the U.S. in 1932 and has used the trademark ZIPPO continuously since that date. ZMC has actively sold ZIPPO brand lighters and other trademarked products in the USA and in over 160 countries for many years and continues to sell these products in the USA and worldwide. The Zippo windproof lighter has been described as a design icon of the Twentieth Century; and the ZIPPO trademark is regarded as one of the world''s famous marks.<br>\r\n<br>\r\n<h3>II.THE LEGAL AUTHORITY TO PROHIBIT SALES</h3>\r\n<br>\r\n1. Sales of counterfeit products; the misuse of Zippo trademarks and copyrights. Trademarks are used to identify goods and services and to distinguish them from others. The Zippo marks include the famous ZIPPO brand name in various designs and formats and other names and marks, such as the shape of the Zippo windproof lighter and the Flame Logo, that are used as trademarks to identify lighters and other goods as originating from ZMC. The use of a trademark, without authorization, which is substantially identical to a trademark validly registered in respect of such goods, or which cannot be distinguished in its essential aspects from such a trademark for identifying products not originating from the ZMC, is counterfeiting. Counterfeiting is a serious infringement of trademark law and may such use be subject to criminal sanctions as well.<br>\r\n<br>\r\n\r\nFraming of, or linkage to any Zippo website, or use of any photographs, trademarks, designs or texts contained therein, without the express written consent of ZMC, is also an infringement of ZMC’s copyright and trademark rights.<br>\r\n<br>\r\n\r\n“Keyword spamming” is another example of the misuse of trademarks. Keyword spamming is a search engine optimization technique that uses, often as a metatag, the trademark / brand name of another product in an effort to divert customers to one’s own product offering and is an infringement of the rights of the trademark owner.<br>\r\n<br>\r\n\r\n2. Sales of other brands of lighters that have the shape of the Zippo windproof lighter<br>\r\n<br>\r\n\r\nAs mentioned above, ZMC  has a trademark registration in the USA and in many other countries which protects the highly distinctive shape of its windproof lighter with its characteristic arcuate top (“Shape Mark”). Other products, not necessarily only lighters, which have this shape, infringe this Shape Mark. The scope of protection of the Shape Mark is not limited to any particular size. <br>\r\n<br>\r\n\r\nZMC takes action against products which bear a shape substantially identical to the one protected with the Shape Mark, including its characteristic arcuate top.<br>\r\n<br>\r\n\r\n3.Unauthorized alteration, decoration, engraving of Zippo lighters and sales of Zippo lighters that have been engraved, decorated or otherwise altered without ZMC’s consent, infringe it’s trademark rights. Specifically, the alteration, decoration, engraving and sale of Zippo lighters, using images and designs that have not been authorized by ZMC, directly infringes Zippo’s trademark rights. Furthermore, the use of the ZIPPO name and of the famous registered Zippo lighter shape in auction website listings, including those on eBay, without ZMC’s consent, are also infringements. Such infringements are likely to cause consumers to be deceived into believing that these offered products are authorized, approved, or in some other way associated with ZMC. They are not. The unauthorized alteration or decoration of a Zippo windproof lighter has rendered it to be no longer genuine.<br>\r\n<br>\r\n\r\n\r\nIn addition, the decoration of Zippo lighters with images and designs not approved by ZMC is likely to tarnish the reputation of the ZIPPO trademark which for some eighty years has been perceived as an All-American icon. The Zippo brand is associated with the images that ZMC selects and affixes on them in its sole discretion. ZMC owes to its customers and to the many collectors of its Zippo windproof lighters the assurance of the integrity and authenticity of the designs and decorations on a Zippo windproof lighter.<br>\r\n<br>\r\n\r\nFor any of the above reasons, ZMC will demand that the commercial seller of such products cease &amp; desist all such activities without any further delay. If such seller does not comply, ZMC will take whatever action is legally appropriate to enforce its legal rights.<br>\r\n<br>\r\n\r\n\r\n                            </span></div>\r\n                            <!-- eo .inner -->\r\n                        </section><!-- eo .wholeContent -->\r\n                    </div>\r\n                    <!-- eo .wholeInner -->\r\n                </div>\r\n                <!-- eo .wholeMain -->\r\n            </section>', '2014-09-20 15:14:46', '2014-09-20 15:14:46', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(24, 'Product Patents', 'one_column', NULL, NULL, 'product-patents', NULL, '<section class="wholePage acctAddress clearfix">\r\n                <div class="wholeMain clearfix">\r\n                    <div class="wholeInner clearfix">\r\n                        <h2 class="wholeHdr txtBebas">Privacy &amp; Legal </h2>\r\n                        <nav class="leftInnerNav txtBebas">{{block type="cms/block" block_id="privacy-links"}}</nav>\r\n                        <section class="wholeContent">\r\n                            <div class="inner clearfix txtBold">\r\n                                <h3 class="hdrWholeCont txtRed txtBebas">\r\n                                    Product Patents</h3>\r\n                                      <table border="0">\r\n   <tbody><tr>\r\n          <td colspan="2"><h3 class="txtRed"><a style="color: #df101d;" target="none" href="http://zippo.com/images/editorials/1_1839_PDF_Windproof.pdf">Lighters</a></h3></td>\r\n           </tr>    \r\n      <tr>\r\n          <td>&nbsp;</td>\r\n          <td>&nbsp;</td>\r\n        </tr>      \r\n        <tr>\r\n          <td colspan="2"><h3 class="txtRed"><a style="color: #df101d;" target="none" href="http://zippo.com/images/editorials/1_1839_PDF_Outdoor.pdf">Outdoor</a></h3></td>\r\n        </tr>\r\n        <tr>\r\n          <td>&nbsp;</td>\r\n          <td>&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n          <td colspan="2"><h3 class="txtRed"><a style="color: #df101d;" target="none" href="http://zippo.com/images/editorials/1_1839_PDF_Packaging.pdf">Packaging</a></h3></td>\r\n        </tr>\r\n        <tr>\r\n          <td>&nbsp;</td>\r\n          <td>&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n\r\n <td colspan="2">\r\n          <h3 class="txtRed"><a style="color: #df101d;" target="none" href="      ">   </a></h3></td>\r\n        </tr>\r\n        <tr>\r\n          <td>&nbsp;</td>\r\n          <td>&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n          <td colspan="2"><h3 class="txtRed"><a